INSERT INTO `tblposts` (`id`, `PostTitle`, `CategoryId`, `SubCategoryId`, `PostDetails`, `PostingDate`, `UpdationDate`, `Is_Active`, `PostUrl`, `PostImage`, `Ctvid`) VALUES
(14, 'Haaland phá kỷ lục của cựu tiền đạo Man Utd', 13, 11, '<p><span style=\"color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\">Tiền đạo Man City Erling Haaland phá kỷ lục cầu thủ cần ít trận nhất để ghi 50 bàn Ngoại hạng Anh của Andy Cole.</span></p><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\">Tối 25/11, với bàn mở tỷ số trong trận Man City hoà Liverpool 1-1 ở vòng 13, Haaland cán mốc 50 bàn Ngoại hạng Anh. Tiền đạo 23 tuổi người Na Uy chỉ cần 48 trận để đạt con số này, trong khi kỷ lục trước đó thuộc về Andy Cole với 65 trận. Điểm nổi bật duy nhất của Cole là không cần bất cứ quả phạt đền nào khi xác lập cột mốc kể trên.</p><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\">Các cầu thủ xếp tiếp theo trong danh sách này gồm: Alan Shearer (66 trận), Ruud Van Nistelrooy (68 trận), Fernando Torres và Mohammed Salah (72 trận).</p><figure data-size=\"true\" itemprop=\"associatedMedia image\" itemscope=\"\" itemtype=\"http://schema.org/ImageObject\" class=\"tplCaption action_thumb_added\" style=\"margin-right: auto; margin-bottom: 15px; margin-left: auto; padding: 0px; text-rendering: optimizelegibility; max-width: 100%; clear: both; position: relative; text-align: center; width: 680px; float: left; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\"><div class=\"fig-picture\" style=\"margin: 0px; padding: 0px 0px 453.038px; text-rendering: optimizelegibility; width: 680px; float: left; display: table; -webkit-box-pack: center; justify-content: center; background: rgb(240, 238, 234); position: relative;\"><picture data-inimage=\"done\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility;\"><source data-srcset=\"https://i1-thethao.vnecdn.net/2023/11/26/haaland3-8401-1700963384.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=2GbMq-57kShLwewnU6Nmlg 1x, https://i1-thethao.vnecdn.net/2023/11/26/haaland3-8401-1700963384.jpg?w=1020&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=xcx-PFKQYAOHli8U1sNiOA 1.5x, https://i1-thethao.vnecdn.net/2023/11/26/haaland3-8401-1700963384.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=2&amp;fit=crop&amp;s=TSEpQiGWBGdJCP8bibcUrw 2x\" srcset=\"https://i1-thethao.vnecdn.net/2023/11/26/haaland3-8401-1700963384.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=2GbMq-57kShLwewnU6Nmlg 1x, https://i1-thethao.vnecdn.net/2023/11/26/haaland3-8401-1700963384.jpg?w=1020&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=xcx-PFKQYAOHli8U1sNiOA 1.5x, https://i1-thethao.vnecdn.net/2023/11/26/haaland3-8401-1700963384.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=2&amp;fit=crop&amp;s=TSEpQiGWBGdJCP8bibcUrw 2x\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility;\"><img itemprop=\"contentUrl\" loading=\"lazy\" intrinsicsize=\"680x0\" alt=\"Haaland sút ghi bàn trong trận Man City 1-1 Liverpool ở vòng 13 Ngoại hạng Anh tối 25/11, trên sân Etihad. Ảnh: Reuters\" class=\"lazy lazied\" src=\"https://i1-thethao.vnecdn.net/2023/11/26/haaland3-8401-1700963384.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=2GbMq-57kShLwewnU6Nmlg\" data-src=\"https://i1-thethao.vnecdn.net/2023/11/26/haaland3-8401-1700963384.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=2GbMq-57kShLwewnU6Nmlg\" data-ll-status=\"loaded\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility; font-size: 0px; line-height: 0; max-width: 100%; position: absolute; top: 0px; left: 0px; max-height: 700px; width: 680px;\"><div class=\"embed-container-ads\" style=\"margin-top: 0px; margin-right: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-left: 0px; text-rendering: optimizelegibility; width: 680px; background: transparent; overflow: hidden; float: left; height: 100px; position: absolute; bottom: -1px; margin-bottom: 0px !important; padding-bottom: 0px !important;\"><div id=\"sis_inimage\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility; position: relative; width: 680px; height: 100px;\"></div></div></picture></div><figcaption itemprop=\"description\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility; width: 680px; float: left; text-align: left;\"><p class=\"Image\" style=\"padding: 10px 0px 0px; text-rendering: optimizespeed; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 14px; line-height: 22.4px;\">Haaland sút ghi bàn trong trận Man City 1-1 Liverpool ở vòng 13 Ngoại hạng Anh tối 25/11, trên sân Etihad. Ảnh:&nbsp;<em style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility;\">Reuters</em></p></figcaption></figure><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\">Với Man Utd, Cole từng giành năm Ngoại hạng Anh và một Champions League. Trên mọi đấu trường, huyền thoại 52 tuổi từng ghi 121 bàn trong 257 trận cho Man Utd, 68 bàn trong 84 trận cho Newcastle, 37 bàn trong 100 trận cho Blackburn Rovers, 13 bàn trong 39 trận cho Fulham và 10 bàn trong 23 trận cho Man City.</p><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\">Mục tiêu tiếp theo của Haaland có thể là cầu thủ ghi 100 bàn Ngoại hạng Anh nhanh nhất. Shearer đang giữ kỷ lục này qua 124 trận.</p><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\">Mùa trước, với 36 bàn,&nbsp;<a href=\"https://vnexpress.net/chu-de/erling-haaland-979\" rel=\"dofollow\" data-itm-source=\"#vn_source=Detail-TheThao_NgoaiHangAnh_TinTuc-4681390&amp;vn_campaign=Box-InternalLink&amp;vn_medium=Link-Haaland&amp;vn_term=Desktop&amp;vn_thumb=0\" data-itm-added=\"1\" style=\"margin: 0px; padding: 0px 0px 1px; text-rendering: optimizelegibility; color: rgb(7, 109, 182); position: relative; text-underline-position: under; border-bottom-width: 1px; border-bottom-style: solid;\">Haaland</a>&nbsp;đã phá kỷ lục cầu thủ ghi nhiều bàn nhất trong một mùa Ngoại hạng Anh. Kỷ lục trước đó là 32 bàn do Salah lập vào mùa 2017-2018.</p><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\">Trên sân Etihad hôm qua, Haaland mở tỷ số phút 27. Sau khi nhận đường chuyền của Nathan Ake, tiền đạo 23 tuổi chạm hai nhịp để đưa bóng vào vòng cấm và ổn định vị trí rồi sút bật tay thủ môn Alisson. Tuy nhiên, Man City không bảo toàn được ba điểm. Phút 80, sau đường chuyền của Salah, Trent Alexander-Arnold sút chéo góc gỡ hòa cho&nbsp;<a href=\"https://vnexpress.net/the-thao/du-lieu-bong-da/doi-bong/liverpool-40\" rel=\"dofollow\" style=\"margin: 0px; padding: 0px 0px 1px; text-rendering: optimizelegibility; color: rgb(7, 109, 182); position: relative; text-underline-position: under; border-bottom-width: 1px; border-bottom-style: solid;\">Liverpool</a>.</p><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\">Sau trận này,&nbsp;<a href=\"https://vnexpress.net/the-thao/du-lieu-bong-da/doi-bong/man-city-50\" rel=\"dofollow\" style=\"margin: 0px; padding: 0px 0px 1px; text-rendering: optimizelegibility; color: rgb(7, 109, 182); position: relative; text-underline-position: under; border-bottom-width: 1px; border-bottom-style: solid;\">Man City</a>&nbsp;mất vị trí dẫn đầu khi chỉ có 29 điểm sau 13 trận. Trong khi đó, sau trận thắng 1-0 trên sân của Brentford, Arsenal lên dẫn đầu với 30 điểm. Liverpool xếp thứ ba với 28 điểm.</p><p><br></p>', '2023-11-26 07:45:12', '2023-12-19 14:39:04', 1, 'Haaland-phá-kỷ-lục-của-cựu-tiền-đạo-Man-Utd', '067cf1087a156cdfd31e831207d61bc6.jpg', 1),
(15, 'HAGL chôn chân ở đáy bảng V-League', 13, 11, '<p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\">Thua ngược Thể Công 1-2 ở vòng 5, HAGL nối dài mạch không thắng từ đầu V-League 2023-2024 và tiếp tục ở cuối bảng.<br></p><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\">Trước trận đấu trên sân Pleiku chiều 8/12, HAGL hòa hai và thua hai tại V-League 2023-2024, đồng thời bị loại ngay vòng sơ loại Cup Quốc gia. Điều này phản ánh phần nào thực tế u tối đang diễn ra bên trong đội bóng. Bên cạnh việc phải đổi tên, trở thành LPBank HAGL, họ còn có những xáo trộn về nhân sự và sắp tới có thể là ở nhóm lãnh đạo bên trên.</p><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\">Trong bối cảnh này, các cầu thủ HAGL không thể làm gì khác ngoài việc tập trung vào chuyên môn, cố gắng thi đấu tốt để cải thiện vị trí. Việc tiếp Thể Công - đội bóng cũng không có phong độ cao nhất từ đầu mùa - được đánh giá là cơ hội để thầy trò HLV Kiatisuk Senamuang hướng đến chiến thắng đầu tiên từ đầu mùa.</p><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\">Phút thứ 2, Jhon Cley sút phạt mạnh cách khung thành Thể Công gần 30 mét, khiến thủ môn Phạm Văn Phong vất vả cản phá. Đến phút 15, Châu Ngọc Quang đi bóng bên cánh trái dứt điểm chệch đích, nhưng vô tình thành kiến tạo để Minh Vương đệm cận thành mở tỷ số.</p><figure data-size=\"true\" itemprop=\"associatedMedia image\" itemscope=\"\" itemtype=\"http://schema.org/ImageObject\" class=\"tplCaption action_thumb_added\" style=\"margin-right: auto; margin-bottom: 15px; margin-left: auto; padding: 0px; text-rendering: optimizelegibility; max-width: 100%; clear: both; position: relative; text-align: center; width: 680px; float: left; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\"><div class=\"fig-picture\" style=\"margin: 0px; padding: 0px 0px 500px; text-rendering: optimizelegibility; width: 680px; float: left; display: table; -webkit-box-pack: center; justify-content: center; background: rgb(240, 238, 234); position: relative;\"><picture data-inimage=\"done\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility;\"><source data-srcset=\"https://i1-thethao.vnecdn.net/2023/12/08/hagl-the-cong-vong-5-v-league-1526-8346-1702037421.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=Q1WScapXqiAxnZROGuUm8g 1x, https://i1-thethao.vnecdn.net/2023/12/08/hagl-the-cong-vong-5-v-league-1526-8346-1702037421.jpg?w=1020&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=XgZm_d4YgcrLnDAJzcp60g 1.5x, https://i1-thethao.vnecdn.net/2023/12/08/hagl-the-cong-vong-5-v-league-1526-8346-1702037421.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=2&amp;fit=crop&amp;s=g0PdFcw7dokn4G2JizIFxA 2x\" srcset=\"https://i1-thethao.vnecdn.net/2023/12/08/hagl-the-cong-vong-5-v-league-1526-8346-1702037421.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=Q1WScapXqiAxnZROGuUm8g 1x, https://i1-thethao.vnecdn.net/2023/12/08/hagl-the-cong-vong-5-v-league-1526-8346-1702037421.jpg?w=1020&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=XgZm_d4YgcrLnDAJzcp60g 1.5x, https://i1-thethao.vnecdn.net/2023/12/08/hagl-the-cong-vong-5-v-league-1526-8346-1702037421.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=2&amp;fit=crop&amp;s=g0PdFcw7dokn4G2JizIFxA 2x\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility;\"><img itemprop=\"contentUrl\" loading=\"lazy\" intrinsicsize=\"680x0\" alt=\"Trần Minh Vương (thứ hai từ trái sang) mở tỷ số cho HAGL. Ảnh: Đức Đồng\" class=\"lazy lazied\" src=\"https://i1-thethao.vnecdn.net/2023/12/08/hagl-the-cong-vong-5-v-league-1526-8346-1702037421.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=Q1WScapXqiAxnZROGuUm8g\" data-src=\"https://i1-thethao.vnecdn.net/2023/12/08/hagl-the-cong-vong-5-v-league-1526-8346-1702037421.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=Q1WScapXqiAxnZROGuUm8g\" data-ll-status=\"loaded\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility; font-size: 0px; line-height: 0; max-width: 100%; position: absolute; top: 0px; left: 0px; max-height: 700px; width: 680px;\"><div class=\"embed-container-ads\" style=\"margin-top: 0px; margin-right: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-left: 0px; text-rendering: optimizelegibility; width: 680px; background: transparent; overflow: hidden; float: left; height: 100px; position: absolute; bottom: -1px; margin-bottom: 0px !important; padding-bottom: 0px !important;\"><div id=\"sis_inimage\" data-google-query-id=\"CJWN8tOAgIMDFQozlgodDb0NUQ\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility; position: relative; width: 680px; height: 100px;\"><div id=\"google_ads_iframe_/27973503/Vnexpress/Desktop/Inimage/Thethao/Thethao.vleague.detail_0__container__\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility; border: 0pt none;\"><iframe id=\"google_ads_iframe_/27973503/Vnexpress/Desktop/Inimage/Thethao/Thethao.vleague.detail_0\" name=\"google_ads_iframe_/27973503/Vnexpress/Desktop/Inimage/Thethao/Thethao.vleague.detail_0\" title=\"3rd party ad content\" width=\"1\" height=\"1\" scrolling=\"no\" marginwidth=\"0\" marginheight=\"0\" frameborder=\"0\" role=\"region\" aria-label=\"Advertisement\" tabindex=\"0\" allow=\"attribution-reporting\" data-google-container-id=\"4\" data-load-complete=\"true\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility; border-width: 0px; border-style: initial; vertical-align: bottom;\"></iframe></div></div></div></picture></div><figcaption itemprop=\"description\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility; width: 680px; float: left; text-align: left;\"><p class=\"Image\" style=\"padding: 10px 0px 0px; text-rendering: optimizespeed; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 14px; line-height: 22.4px;\">Trần Minh Vương (thứ hai từ trái sang) mừng bàn mở tỷ số cho HAGL. Ảnh:&nbsp;<em style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility;\">Đức Đồng</em></p></figcaption></figure><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\">Nhưng niềm vui của HAGL không kéo dài lâu. Ba phút sau, Thể Công tấn công biên phải. Nguyễn Đức Chiến chọc khe để Nguyễn Đức Hoàng Minh thoát xuống trả ngược ra tuyến hai cho Bruno Cunha sút chìm vào góc trái. Đến phút 20, Nguyễn Hoàng Đức chuyền dài từ gần giữa sân vào vòng cấm chếch cánh trái để Khuất Văn Khang sút chéo góc nâng tỷ số lên 2-1.</p><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\"><a href=\"https://vnexpress.net/the-thao/du-lieu-bong-da/doi-bong/hagl-3673\" rel=\"dofollow\" style=\"margin: 0px; padding: 0px 0px 1px; text-rendering: optimizelegibility; color: rgb(7, 109, 182); position: relative; text-underline-position: under; border-bottom-width: 1px; border-bottom-style: solid;\">HAGL</a>&nbsp;có cơ hội gỡ hòa ở phút 31 nhưng không tận dụng được. Tiền đạo trẻ Quốc Việt bất ngờ nhận bóng sau cú sút xa của đồng đội, nhưng lại kết thúc nhẹ và không đủ hiểm để đánh bại Phạm Văn Phong.</p><figure data-size=\"true\" itemprop=\"associatedMedia image\" itemscope=\"\" itemtype=\"http://schema.org/ImageObject\" class=\"tplCaption action_thumb_added\" style=\"margin-right: auto; margin-bottom: 15px; margin-left: auto; padding: 0px; text-rendering: optimizelegibility; max-width: 100%; clear: both; position: relative; text-align: center; width: 680px; float: left; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\"><div class=\"fig-picture\" style=\"margin: 0px; padding: 0px 0px 451.172px; text-rendering: optimizelegibility; width: 680px; float: left; display: table; -webkit-box-pack: center; justify-content: center; background: rgb(240, 238, 234); position: relative;\"><picture style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility;\"><source data-srcset=\"https://i1-thethao.vnecdn.net/2023/12/08/hagl-the-cong-vong-5-v-league-2010-1313-1702037421.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=7xcXLdKIgeMbGYvc4nerLA 1x, https://i1-thethao.vnecdn.net/2023/12/08/hagl-the-cong-vong-5-v-league-2010-1313-1702037421.jpg?w=1020&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=SdoHxU1JmsCNTR2l70F2mQ 1.5x, https://i1-thethao.vnecdn.net/2023/12/08/hagl-the-cong-vong-5-v-league-2010-1313-1702037421.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=2&amp;fit=crop&amp;s=gCJkIu5y9gT7wapnQLQzdw 2x\" srcset=\"https://i1-thethao.vnecdn.net/2023/12/08/hagl-the-cong-vong-5-v-league-2010-1313-1702037421.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=7xcXLdKIgeMbGYvc4nerLA 1x, https://i1-thethao.vnecdn.net/2023/12/08/hagl-the-cong-vong-5-v-league-2010-1313-1702037421.jpg?w=1020&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=SdoHxU1JmsCNTR2l70F2mQ 1.5x, https://i1-thethao.vnecdn.net/2023/12/08/hagl-the-cong-vong-5-v-league-2010-1313-1702037421.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=2&amp;fit=crop&amp;s=gCJkIu5y9gT7wapnQLQzdw 2x\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility;\"><img itemprop=\"contentUrl\" loading=\"lazy\" intrinsicsize=\"680x0\" alt=\"Bruno Cunha (số 37) ăn mừng bàn gỡ cho Thể Công. Ảnh: Đức Đồng\" class=\"lazy lazied\" src=\"https://i1-thethao.vnecdn.net/2023/12/08/hagl-the-cong-vong-5-v-league-2010-1313-1702037421.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=7xcXLdKIgeMbGYvc4nerLA\" data-src=\"https://i1-thethao.vnecdn.net/2023/12/08/hagl-the-cong-vong-5-v-league-2010-1313-1702037421.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=7xcXLdKIgeMbGYvc4nerLA\" data-ll-status=\"loaded\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility; font-size: 0px; line-height: 0; max-width: 100%; position: absolute; top: 0px; left: 0px; max-height: 700px; width: 680px;\"></picture></div><figcaption itemprop=\"description\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility; width: 680px; float: left; text-align: left;\"><p class=\"Image\" style=\"padding: 10px 0px 0px; text-rendering: optimizespeed; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 14px; line-height: 22.4px;\">Bruno Cunha (số 37) ăn mừng bàn gỡ cho Thể Công. Ảnh:&nbsp;<em style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility;\">Đức Đồng</em></p></figcaption></figure><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\">Sang hiệp hai,&nbsp;<a href=\"https://vnexpress.net/the-thao/du-lieu-bong-da/doi-bong/the-cong-3681\" rel=\"dofollow\" style=\"margin: 0px; padding: 0px 0px 1px; text-rendering: optimizelegibility; color: rgb(7, 109, 182); position: relative; text-underline-position: under; border-bottom-width: 1px; border-bottom-style: solid;\">Thể Công</a>&nbsp;chủ động dàn quân phòng ngự, khiến HAGL không thể phối hợp lên bóng và thế trận vì thế trở nên nhàm chán. Hai đội không tạo nên tình huống tấn công đáng chú ý nào.</p><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\">Kết quả này giúp Thể Công vươn lên thứ ba giải vô địch Quốc gia Night Wolf 2023-2024 với tám điểm, bằng điểm nhưng kém hiệu số bàn thắng bại và thi đấu nhiều hơn một trận so với Thanh Hóa. HAGL chôn chân ở cuối bảng với hai điểm, bằng Hà Tĩnh và Quảng Nam nhưng kém hiệu số bàn thắng bại (-6 so với -3 và -2).</p><figure class=\"item_slide_show clearfix\" style=\"margin-right: auto; margin-bottom: 20px; margin-left: auto; padding: 0px; text-rendering: optimizelegibility; max-width: 100%; clear: both; position: relative; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\"><div id=\"video_parent_389660\" class=\"box_embed_video_parent embed_video_new\" data-vcate=\"1003834\" data-vscate=\"1003008\" data-vscaten=\"Thể thao\" data-vid=\"389660\" data-ratio=\"1\" data-articleoriginal=\"4686690\" data-ads=\"0\" data-license=\"0\" data-duration=\"153\" data-brandsafe=\"0\" data-type=\"0\" data-play=\"0\" data-frame=\"\" data-aot=\"HAGL 1-2 Thể Công\" data-videoclassify=\"None\" data-initdom=\"1\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility; position: relative; overflow: hidden; clear: both;\"><div data-vid=\"389660\" class=\"box_img_video embed-container\" style=\"margin: 0px; padding: 0px 0px 382.5px; text-rendering: optimizelegibility; position: relative; height: 0px; overflow: hidden; clear: both; cursor: pointer;\"><img src=\"https://iv1.vnecdn.net/thethao/images/web/2023/12/08/hagl-1-2-the-cong-1702039288.jpg?w=0&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=5S-SCp2q1bPx9ysX8rtpEA\" alt=\"HAGL 1-2 Thể Công\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility; font-size: 0px; line-height: 0; max-width: 100%; width: 680px; height: 382.5px;\"><div class=\"icon_blockvideo\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility; inset: 0px; position: absolute;\"><div class=\"img_icon\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility; transform: translate(-50%, -50%); transition-duration: 250ms; transition-property: all; transition-timing-function: cubic-bezier(0.7, 1, 0.7, 1); top: 191.25px; left: 340px; display: inline-block !important; vertical-align: middle !important; position: absolute !important; width: 0px !important; height: 0px !important; border-top: 22px solid rgba(255, 255, 255, 0) !important; border-left: 35px solid rgb(255, 255, 255) !important; border-bottom: 22px solid rgba(255, 255, 255, 0) !important; border-radius: 5px 0px 0px 5px !important;\">&nbsp;</div><div class=\"image_icon_center\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility; display: inline-block; height: 382.5px; vertical-align: middle;\">&nbsp;</div></div></div></div><figcaption class=\"desc_cation\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility;\"><div class=\"inner_caption\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility;\"><p class=\"Image\" style=\"padding: 10px 0px 0px; text-rendering: optimizespeed; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 14px; line-height: 22.4px;\">Diễn biến chính trận HAGL 1-2 Thể Công.</p></div></figcaption></figure><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\">Ở vòng 6 ngày 17/12, HAGL làm khách của SLNA, còn Thể Công tiếp Hà Nội FC.</p><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\"><strong style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility;\">Đội hình xuất phát</strong></p><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\"><strong style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility;\">HAGL</strong>: Phan Đình Vũ Hải, Lê Văn Sơn, Thanh Nhân, Dụng Quang Nho, Jairo Filho, Văn Triệu, Châu Ngọc Quang, Trần Minh Vương, Tuấn Anh, Quốc Việt, Jhon Cley</p><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\"><strong style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility;\">Thể Công</strong>: Phạm Văn Phong, Bùi Tiến Dũng, Thanh Bình, Trần Mạnh Cường, Trần Ngọc Sơn, Nguyễn Đức Hoàng Minh, Đức Chiến, Hoàng Đức, Khuất Văn Khang, Nhâm Mạnh Dũng, Bruno Cunha.</p>', '2023-12-08 14:04:40', '2023-12-19 14:39:07', 1, 'HAGL-chôn-chân-ở-đáy-bảng-V-League', '4ec0d07e27fc3c46ef1fa7813f267ba9.jpg', 1),
(16, 'Maguire hay nhất Ngoại hạng Anh tháng 11', 13, 11, '<p class=\"description\" style=\"margin-bottom: 15px; padding: 0px; text-rendering: optimizelegibility; font-size: 18px; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; background-color: rgb(252, 250, 246);\"><span class=\"location-stamp\" style=\"margin: 0px 15px 0px 0px; padding: 0px; text-rendering: optimizelegibility; font-size: 16px; text-transform: uppercase; letter-spacing: -0.5px; position: relative; color: rgb(117, 117, 117) !important;\">ANH</span>Trung vệ Man Utd Harry Maguire nhận giải Cầu thủ hay nhất tháng 11 của Ngoại hạng Anh, sau màn trở lại ấn tượng.</p><article class=\"fck_detail \" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility; width: 680px; float: left; position: relative; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 18px; line-height: 28.8px; font-family: arial; color: rgb(34, 34, 34); background-color: rgb(252, 250, 246);\"><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px;\">Trong thông báo ngày 8/12, ban tổ chức Ngoại hạng Anh đánh giá Maguire đã lấy lại phong độ, chiếm trọn lòng tin từ HLV Erik ten Hag để giành lại suất đá chính. Anh chơi trọn số phút ở ba trận trong tháng 11, giúp đội giữ sạch lưới và toàn thắng, trước Fulham, Luton và Everton.</p><figure data-size=\"true\" itemprop=\"associatedMedia image\" itemscope=\"\" itemtype=\"http://schema.org/ImageObject\" class=\"tplCaption action_thumb_added\" style=\"margin-right: auto; margin-bottom: 15px; margin-left: auto; padding: 0px; text-rendering: optimizelegibility; max-width: 100%; clear: both; position: relative; text-align: center; width: 680px; float: left;\"><div class=\"fig-picture\" style=\"margin: 0px; padding: 0px 0px 408.25px; text-rendering: optimizelegibility; width: 680px; float: left; display: table; -webkit-box-pack: center; justify-content: center; background: rgb(240, 238, 234); position: relative;\"><picture data-inimage=\"done\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility;\"><source data-srcset=\"https://i1-thethao.vnecdn.net/2023/12/08/maguire-jpeg-1702035232-2831-1702035874.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=7LPPhG0HMKymv6xzK1cOUw 1x, https://i1-thethao.vnecdn.net/2023/12/08/maguire-jpeg-1702035232-2831-1702035874.jpg?w=1020&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=xDCxp5SC2PqMS5D4qvhCGQ 1.5x, https://i1-thethao.vnecdn.net/2023/12/08/maguire-jpeg-1702035232-2831-1702035874.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=2&amp;fit=crop&amp;s=nVl0Ma60wsckL3ixRXL0jg 2x\" srcset=\"https://i1-thethao.vnecdn.net/2023/12/08/maguire-jpeg-1702035232-2831-1702035874.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=7LPPhG0HMKymv6xzK1cOUw 1x, https://i1-thethao.vnecdn.net/2023/12/08/maguire-jpeg-1702035232-2831-1702035874.jpg?w=1020&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=xDCxp5SC2PqMS5D4qvhCGQ 1.5x, https://i1-thethao.vnecdn.net/2023/12/08/maguire-jpeg-1702035232-2831-1702035874.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=2&amp;fit=crop&amp;s=nVl0Ma60wsckL3ixRXL0jg 2x\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility;\"><img itemprop=\"contentUrl\" loading=\"lazy\" intrinsicsize=\"680x0\" alt=\"Harry Maguire nhận giải Cầu thủ hay nhất tháng ở Ngoại hạng Anh trên sân tập Trafford ở Carrington, thành phố Manchester ngày 8/12/2023. Ảnh: EPL\" class=\"lazy lazied\" src=\"https://i1-thethao.vnecdn.net/2023/12/08/maguire-jpeg-1702035232-2831-1702035874.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=7LPPhG0HMKymv6xzK1cOUw\" data-src=\"https://i1-thethao.vnecdn.net/2023/12/08/maguire-jpeg-1702035232-2831-1702035874.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=7LPPhG0HMKymv6xzK1cOUw\" data-ll-status=\"loaded\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility; font-size: 0px; line-height: 0; max-width: 100%; position: absolute; top: 0px; left: 0px; max-height: 700px; width: 680px;\"><div class=\"embed-container-ads\" style=\"margin-top: 0px; margin-right: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-left: 0px; text-rendering: optimizelegibility; width: 680px; background: transparent; overflow: hidden; float: left; height: 100px; position: absolute; bottom: -1px; margin-bottom: 0px !important; padding-bottom: 0px !important;\"><div id=\"sis_inimage\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility; position: relative; width: 680px; height: 100px;\"></div></div></picture></div><figcaption itemprop=\"description\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility; width: 680px; float: left; text-align: left;\"><p class=\"Image\" style=\"padding: 10px 0px 0px; text-rendering: optimizespeed; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 14px; line-height: 22.4px;\">Harry Maguire nhận giải \"Cầu thủ hay nhất tháng ở Ngoại hạng Anh\" trên sân tập Trafford ở Carrington, thành phố Manchester ngày 8/12/2023. Ảnh:&nbsp;<em style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility;\">EPL</em></p></figcaption></figure><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px;\">\"Tôi không thể giành giải này nếu thiếu các đồng đội, ban huấn luyện và người hâm mộ\", anh nói. \"Tôi trân trọng tình cảm và sự ủng hộ của các bạn\".</p><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px;\"><a href=\"https://vnexpress.net/chu-de/harry-maguire-240\" rel=\"dofollow\" data-itm-source=\"#vn_source=Detail-TheThao_NgoaiHangAnh_TinTuc-4686672&amp;vn_campaign=Box-InternalLink&amp;vn_medium=Link-Maguire&amp;vn_term=Desktop&amp;vn_thumb=0\" data-itm-added=\"1\" style=\"margin: 0px; padding: 0px 0px 1px; text-rendering: optimizelegibility; color: rgb(7, 109, 182); position: relative; text-underline-position: under; border-bottom-width: 1px; border-bottom-style: solid;\">Maguire</a>&nbsp;áp đảo ở các thông số phòng ngự ở Ngoại hạng Anh tháng 11. Anh đồng dẫn đầu ở số phút thi đấu, trận giữ sạch lưới và chắn bóng. Số pha không chiến thành công của trung vệ 30 tuổi đứng thứ hai, và số pha phá bóng đứng thứ năm.</p><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px;\">Maguire là hậu vệ thứ 15 trong lịch sử nhận được giải thưởng này, và là hậu vệ đầu tiên được vinh danh kể từ Joel Matip cho Liverpool tháng 2/2022. Lịch sử&nbsp;<a href=\"https://vnexpress.net/the-thao/du-lieu-bong-da/doi-bong/man-utd-33\" rel=\"dofollow\" style=\"margin: 0px; padding: 0px 0px 1px; text-rendering: optimizelegibility; color: rgb(7, 109, 182); position: relative; text-underline-position: under; border-bottom-width: 1px; border-bottom-style: solid;\">Man Utd</a>&nbsp;mới ghi nhận một hậu vệ khác từng giành giải, là cựu đội trưởng Nemanja Vidic tháng 1/2009. Còn cầu thủ gần nhất của Man Utd đoạt giải là tiền đạo Marcus Rashford tháng 1/2023.</p><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px;\">Maguire từng nhiều lần bị chỉ trích ở hai mùa trước và đầu mùa này, khiến anh mất suất đá chính. Trung vệ tuyển Anh từng bị Man Utd đẩy sang West Ham hè 2023, nhưng anh từ chối vào phút chót vì muốn ở lại để chứng tỏ thực lực và lấy lại niềm tin nơi Ten Hag. Trong vài tháng qua, Maguire thường chơi nổi bật trong các trận đấu của Man Utd, giúp đội thủng lưới ít thứ năm tại giải.</p><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px;\">Giải \"Cầu thủ hay nhất tháng\" của Ngoại hạng Anh do một hội đồng chuyên gia, các đội trưởng, và người hâm mộ bình chọn trực tuyến. Trong đó, số phiếu trực tuyến chỉ chiếm 10% trọng số. Trên mạng xã hội, nhiều CĐV Man Utd lẫn các đội khác mừng cho Maguire. Tài khoản&nbsp;<em style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility;\">wm_1176</em>&nbsp;của một người hâm mộ Chelsea bình luận trên&nbsp;<em style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility;\">Reddit</em>: \"Bản lĩnh của Maguire thực sự đáng nể. Tôi không nghĩ có cầu thủ người Anh nào từng bị ghét bỏ nhiều như vậy, đã tìm lại được phong độ ổn định như anh\".</p></article>', '2023-12-08 14:11:42', NULL, 1, 'Maguire-hay-nhất-Ngoại-hạng-Anh-tháng-11', '4eb2eccd981075c8272ba00aa95b4d81.jpg', 0),
(17, 'Hậu vệ Chelsea: \"VAR chống lại tôi\"', 13, 11, '<p class=\"description\" style=\"margin-bottom: 15px; padding: 0px; text-rendering: optimizelegibility; font-size: 18px; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; background-color: rgb(252, 250, 246);\"><span class=\"location-stamp\" style=\"margin: 0px 15px 0px 0px; padding: 0px; text-rendering: optimizelegibility; font-size: 16px; text-transform: uppercase; letter-spacing: -0.5px; position: relative; color: rgb(117, 117, 117) !important;\">ANH</span>Trang chủ Chelsea dẫn lời trung vệ Levi Colwill trách VAR thiếu nhất quán trong trận thua Man Utd ở vòng 15 Ngoại hạng Anh.</p><article class=\"fck_detail \" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility; width: 680px; float: left; position: relative; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 18px; line-height: 28.8px; font-family: arial; color: rgb(34, 34, 34); background-color: rgb(252, 250, 246);\"><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px;\">Phút 69 trận đấu trên sân Old Trafford, Alejandro Garnacho treo bóng từ bên trái về cột hai để Scott McTominay lao vào đánh đầu ấn định tỷ số 2-1 cho Man Utd. Trước khi Garnacho tạt bóng, Colwill đã theo sát McTominay. Tuy nhiên anh cho rằng bản thân bị tiền vệ Man Utd đẩy và ngã xuống trong lúc theo bóng. VAR đã xem xét tình huống này, nhưng không can thiệp nên chủ nhà được công nhận bàn thắng.</p></article><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\">Gần một ngày sau trận, trang chủ Chelsea đăng bài phát biểu của Colwill. \"VAR có gì đó chống lại tôi\", anh nói. \"Tôi không biết mình đã làm gì ảnh hưởng tới họ. Ở trận trước gặp Brighton, họ cố gắng thổi phạt đền Chelsea. Lần này tôi bị McTominay kéo ngã nhưng họ lại không phạt. Nếu tôi kéo McTominay ngã như vậy, họ sẽ thổi phạt đền cho Man Utd\".</p><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\">Hôm 2/12,&nbsp;<a href=\"https://vnexpress.net/the-thao/du-lieu-bong-da/doi-bong/chelsea-49\" rel=\"dofollow\" style=\"margin: 0px; padding: 0px 0px 1px; text-rendering: optimizelegibility; color: rgb(7, 109, 182); position: relative; text-underline-position: under; border-bottom-width: 1px; border-bottom-style: solid;\">Chelsea</a>&nbsp;thắng đội khách Brighton 3-2 dù phải chơi thiếu người suốt hiệp hai vì thẻ đỏ của Conor Gallagher. Đến phút bù hiệp hai, VAR dành nhiều thời gian kiểm tra tình huống Colwill có thể dùng tay chơi bóng trong cấm địa Chelsea. Tuy nhiên, một góc quay khác cho thấy rõ bóng đập trúng mặt trung vệ này.</p><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\">Tuy nhiên, các cựu cầu thủ không đứng về phía Colwill trong tình huống tranh chấp với McTominay. Cựu tiền đạo Alan Shearer cho rằng McTominay không làm gì quá đáng để bị thổi phạt, và chê Colwill \"quá yếu\". Cựu hậu vệ trái Patrice Evra cũng đồng tình rằng cầu thủ Chelsea \"ngã quá dễ dàng\". Còn cựu tiền đạo Chelsea Jimmy Floyd Hasselbaink bình luận đó là \"bàn thắng hợp lệ\".</p><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\">Colwill 20 tuổi, đã chơi cho Chelsea từ thời U9. Anh được cho Huddersfield Town mượn ở giải hạng hai mùa 2021-2022, rồi chơi ở Ngoại hạng Anh cho Brighton mùa trước. Anh được coi là truyền nhân của John Terry, vì cùng mặc áo số 26 và là \"cây nhà lá vườn\". Colwill được trao băng đội trưởng Chelsea sau khi hậu vệ Reece James thường vắng mặt vì chấn thương, còn Gallagher bị treo giò.</p>', '2023-12-08 14:14:16', '2023-12-19 14:39:10', 0, 'Hậu-vệ-Chelsea:-\"VAR-chống-lại-tôi\"', '7762e24cb43f941c96393c3e8a3ef5cc.png', 5),
(18, 'TP.HCM I vô địch lượt đi giải bóng đá nữ quốc gia', 13, 12, '<p><span style=\"color: rgb(59, 61, 63); font-family: arial, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 18px; font-weight: 600;\">Chiến thắng trước Sơn La ở vòng đấu cuối giúp TP.HCM I có được chức vô địch lượt đi giải bóng đá nữ vô địch quốc gia (VĐQG) - cúp Thái Sơn Bắc 2023.</span></p><p style=\"margin-top: 1.6rem; margin-right: auto; margin-left: auto; color: rgb(52, 58, 64); font-family: arial, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 18px;\">Ở vòng đấu cuối cùng của lượt đi,&nbsp;<a href=\"https://tienphong.vn/tag/tp.hcm+i.tpo\" title=\"TP.HCM I\" style=\"color: rgb(165, 10, 2); transition: all 0.1s ease-in-out 0s;\">TP.HCM I</a>&nbsp;chạm trán Sơn La. Được đánh giá cao hơn đối thủ của mình, TP.HCM I sớm đẩy cao đội hình nhằm tìm kiếm bàn thắng mở tỉ số.</p><p style=\"margin-top: 1.6rem; margin-right: auto; margin-left: auto; color: rgb(52, 58, 64); font-family: arial, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 18px;\">Trong khi đó, Sơn La cho thấy quyết tâm cao. Họ lùi sâu đội hình phòng ngự và kiên nhẫn đeo bám đối thủ dù thua thiệt về trình độ. Trong hiệp 1, TP.HCM I có một vài cơ hội nguy hiểm nhưng không thể tận dụng.</p><p style=\"margin-top: 1.6rem; margin-right: auto; margin-left: auto; color: rgb(52, 58, 64); font-family: arial, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 18px;\">Trước hàng thủ dày đặc và chơi gần khung thành của Sơn La, nhà đương kim vô địch của giải gặp không ít khó khăn. Thủ thành&nbsp;<a href=\"https://tienphong.vn/tag/minh+%c3%81nh.tpo\" title=\"Minh Ánh\" style=\"color: rgb(165, 10, 2); transition: all 0.1s ease-in-out 0s;\">Minh Ánh</a>&nbsp;chơi nổi bật bên phía Sơn La với nhiều pha cứu thua ấn tượng. 45 phút đầu tiên trôi qua mà không có bàn thắng nào được ghi.</p><p style=\"margin-top: 1.6rem; margin-right: auto; margin-left: auto; color: rgb(52, 58, 64); font-family: arial, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 18px;\">Bước sang hiệp 2, khi thể lực có phần giảm sút, Sơn La dần bộc lộ sai sót. Phút 51, Thanh Tâm bị phạm lỗi trong vòng cấm và quả phạt đền dành cho TP.HCM I. Trần Thị Thuỳ Trang dễ dàng ghi bàn thắng mở tỉ số trận đấu từ chấm đá phạt 11 mét cho TP.HCM I.</p><p style=\"margin-top: 1.6rem; margin-right: auto; margin-left: auto; color: rgb(52, 58, 64); font-family: arial, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 18px;\">10 phút sau, vẫn là Thuỳ Trang dứt điểm từ ngoài vòng cấm nhân đôi cách biệt cho đội bóng thành phố mang tên Bác. Tiền vệ kì cựu này hoàn tất cú hat-trick cho riêng mình bằng cú sút rất kĩ thuật từ khoảng cách 23 mét ở phút 76.</p><p style=\"margin-top: 1.6rem; margin-right: auto; margin-left: auto; color: rgb(52, 58, 64); font-family: arial, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 18px;\">Trong những phút cuối cùng,&nbsp;<a href=\"https://tienphong.vn/tag/c%c3%b9+th%e1%bb%8b+hu%e1%bb%b3nh+nh%c6%b0.tpo\" title=\"Cù Thị Huỳnh Như\" style=\"color: rgb(165, 10, 2); transition: all 0.1s ease-in-out 0s;\">Cù Thị Huỳnh Như</a>&nbsp;và Kim Yến ghi thêm 2 bàn nữa, giúp TP.HCM I ấn định chiến thắng 5-0 trước Sơn La. Kết quả này giúp cô trò HLV Kim Chi vô địch lượt đi giải nữ VĐQG – cúp Thái Sơn Bắc 2023.</p><p style=\"margin-top: 1.6rem; margin-right: auto; margin-left: auto; color: rgb(52, 58, 64); font-family: arial, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 18px;\">Ở các trận đấu còn lại vòng 7,&nbsp;<a href=\"https://tienphong.vn/tag/than+ksvn.tpo\" title=\"Than KSVN\" style=\"color: rgb(165, 10, 2); background-color: rgb(255, 255, 255); transition: all 0.1s ease-in-out 0s;\">Than KSVN</a>&nbsp;giành chiến thắng 2-0 trước TP.HCM II, Hà Nội I vượt qua Phong Phú Hà Nam 3-0, Thái Nguyên T&amp;T đánh bại Hà Nội II với tỷ số 4-0.<br></p><p><br></p>', '2023-12-08 14:17:15', '2023-12-19 14:39:12', 1, 'TP.HCM-I-vô-địch-lượt-đi-giải-bóng-đá-nữ-quốc-gia', '894606d1896166323272f73dcf91f8aa.jpg', 2),
(19, 'Giải bóng đá nữ VĐQG - Cúp Thái Sơn Bắc 2023 hấp dẫn ngay ngày khai mạc', 13, 12, '<p><span style=\"color: rgb(59, 61, 63); font-family: arial, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 18px; font-weight: 600;\">Trong ngày khai mạc,&nbsp;loạt trận đầu tiên của lượt đi giải bóng đá nữ VĐQG - Cúp Thái Sơn Bắc 2023 đã diễn ra vô cùng hấp dẫn tại sân Trung tâm đào tạo bóng đá trẻ Việt Nam.</span></p><p style=\"margin-top: 1.6rem; margin-right: auto; margin-left: auto;\">Ngày 16/11, giải bóng đá nữ vô địch quốc gia - cúp Thái Sơn Bắc 2023 đã được khai mạc trên sân của Trung tâm đào tạo bóng đá trẻ Việt Nam (Hà Nội).</p><p style=\"margin-top: 1.6rem; margin-right: auto; margin-left: auto;\">Trong tuyên bố khai mạc giải, bà Nguyễn Thanh Hà - Phó Tổng Thư ký Liên đoàn bóng đá Việt Nam (VFF), Trưởng ban tổ chức giải - cho biết: \"Năm 2023, bóng đá nữ Việt Nam ghi những dấu mốc lịch sử khi đội tuyển nữ lần đầu tiên thi đấu tại Vòng chung kết Cúp bóng đá nữ thế giới 2023; đội tuyển U20 nữ Việt Nam giành quyền vào vòng chung kết giải bóng đá nữ U20 châu Á 2024.</p><p style=\"margin-top: 1.6rem; margin-right: auto; margin-left: auto;\">Những thành công đó có sự đóng góp của hệ thống các giải bóng đá nữ quốc gia cũng như các câu lạc bộ bóng đá nữ. Bước sang tuổi 25, giải bóng đá nữ vô địch quốc gia đón nhận tin vui khi VFF quyết định tăng mức giải thưởng tập thể và cá nhân.</p><p style=\"margin-top: 1.6rem; margin-right: auto; margin-left: auto;\">VFF tin tưởng, với những nỗ lực trong công tác tổ chức, cùng sự chuẩn bị chu đáo của các đội bóng, giải bóng đá nữ vô địch quốc gia - Cúp Thái Sơn Bắc 2023 sẽ có chất lượng chuyên môn cao, tạo nên cuộc đua tranh đầy sôi động, hấp dẫn với tinh thần fair-play\".</p><p style=\"margin-top: 1.6rem; margin-right: auto; margin-left: auto;\">Ngay sau lễ khai mạc, trận đấu giữa Hà Nội I và TP HCM I đã diễn ra trên sân Yanmar Trung tâm đào tạo bóng đá trẻ Việt Nam. Đều là ứng cử viên vô địch hàng đầu của giải, cả Hà Nội I và TP.HCM I tiếp cận trận đấu một cách chắc chắn.</p><p style=\"margin-top: 1.6rem; margin-right: auto; margin-left: auto;\">Trong những phút đầu tiên, tốc độ trận đấu diễn ra khá chậm. Từ giữa hiệp 1, Hà Nội I đẩy cao đội hình và tạo ra một vài cơ hội đáng chú ý. Tuy nhiên, tiền đạo chủ lực Phạm Hải Yến lại không thể dứt điểm thành công.</p><p style=\"margin-top: 1.6rem; margin-right: auto; margin-left: auto;\">Bên kia chiến tuyến, TP.HCM I tấn công dựa vào sự linh hoạt và kinh nghiệm của Bích Thuỳ, Thuỳ Trang. Đáng tiếc, TP.HCM I cũng không thể có được bàn thắng mở tỉ số khi bỏ lỡ những cơ hội đáng chú ý.</p><p style=\"margin-top: 1.6rem; margin-right: auto; margin-left: auto; color: rgb(52, 58, 64); font-family: arial, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 18px;\">Bước sang hiệp 2, thế trận diễn ra giằng co và tiếng còi mãn cuộc vang lên với kết quả hoà 0-0.</p><p style=\"margin-top: 1.6rem; margin-right: auto; margin-left: auto; color: rgb(52, 58, 64); font-family: arial, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 18px;\">Ở trận đấu cùng giờ giữa TP HCM II và Hà Nội II diễn ra tại sân số 1 của Trung tâm đào tạo bóng đá trẻ Việt Nam, Bùi Thị Thương và Kiều Trinh đã mang về chiến thắng 2-0 cho Hà Nội II.</p><p style=\"margin-top: 1.6rem; margin-right: auto; margin-left: auto; color: rgb(52, 58, 64); font-family: arial, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 18px;\">Ngoài ra, ở 2 trận đấu diễn ra trước buổi lễ khai mạc, Phong Phú Hà Nam giành chiến thắng đậm 5-0 trước Sơn La còn Than Khoáng sản Việt Nam cũng thắng 4-1 trước Thái Nguyên T&amp;T để lấy trọn 3 điểm trong lượt trận đầu tiên.</p><p><br></p>', '2023-12-08 14:18:07', '2023-12-19 14:39:15', 1, 'Giải-bóng-đá-nữ-VĐQG---Cúp-Thái-Sơn-Bắc-2023-hấp-dẫn-ngay-ngày-khai-mạc', 'f3ccdd27d2000e3f9255a7e3e2c48800.jpg', 3);
INSERT INTO `tblposts` (`id`, `PostTitle`, `CategoryId`, `SubCategoryId`, `PostDetails`, `PostingDate`, `UpdationDate`, `Is_Active`, `PostUrl`, `PostImage`, `Ctvid`) VALUES
(20, 'Đối thủ hai lần đá hỏng phạt đền trong phút bù giờ, Hà Nam bảo toàn chiến thắng ở vòng 2 giải VĐQG nữ 2023', 13, 12, '<p><span style=\"color: rgb(59, 61, 63); font-family: arial, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 18px; font-weight: 600;\">Giữ được chiến thắng&nbsp;trước Thái Nguyên ở vòng 2, Hà Nam cũng bảo toàn vị trí đỉnh bảng giải bóng đá Nữ VĐQG – cúp Thái Sơn Bắc 2023.</span></p><p style=\"margin-top: 1.6rem; margin-right: auto; margin-left: auto; color: rgb(52, 58, 64); font-family: arial, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 18px;\">Trong trận đấu thuộc vòng 2 giải VĐQG nữ 2023, Hà Nam và Thái Nguyên cầm chân nhau với tỷ số 0-0 khi hiệp 1 kết thúc. Sang hiệp hai, phút 55, Thuỳ Linh giúp Hà Nam vươn lên sau cú dứt điểm rất đẹp mắt. Kịch tính của trận đấu được đẩy lên cao độ trong quãng thời gian bù giờ, khi Thái Nguyên được hưởng quả phạt đền do cầu thủ Hà Nam để bóng chạm tay trong vòng cấm.</p><p style=\"margin-top: 1.6rem; margin-right: auto; margin-left: auto; color: rgb(52, 58, 64); font-family: arial, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 18px;\">Hoài Lương sút phạt đền không thành công nhưng trọng tài cho đá lại vì thủ thành Thuỳ Trang rời khỏi vạch khung thành trước khi cầu thủ của Thái Nguyên dứt điểm. Trong lần thực hiện lại, Hoài Lương vẫn bị Thuỳ Trang cản phá và Hà Nam giành chiến thắng chung cuộc, qua đó tiếp tục giữ vững ngôi đầu bảng.</p><p style=\"margin-top: 1.6rem; margin-right: auto; margin-left: auto; color: rgb(52, 58, 64); font-family: arial, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 18px;\">Ở 3 trận đấu còn lại, Hà Nội I đã thắng Hà Nội II với tỷ số 4-0 với hat-trick của Phạm Hải Yến cùng pha lập công của Hồ Thị Quỳnh. TP.HCM I cũng có chiến thắng dễ dàng 5-0 trước TP.HCM II. Trong khi đó, Than KSVN thắng Sơn La với tỷ số 1-0.<br></p><p><span style=\"color: rgb(59, 61, 63); font-family: arial, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 18px; font-weight: 600;\"><br></span><br></p>', '2023-12-08 14:19:15', '2023-12-19 14:39:19', 1, 'Đối-thủ-hai-lần-đá-hỏng-phạt-đền-trong-phút-bù-giờ,-Hà-Nam-bảo-toàn-chiến-thắng-ở-vòng-2-giải-VĐQG-nữ-2023', '156005c5baf40ff51a327f1c34f2975b.jpg', 2),
(21, 'Tín hiệu đáng lo của Kiều Trinh trước thềm giải bóng chuyền vô địch các CLB thế giới', 14, 14, '<p><span class=\"font-semibold text-lg mb-4 inline-block\" style=\"border-width: 0px; border-style: solid; border-color: rgba(229,231,235,var(--tw-border-opacity)); --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: var(--tw-empty,/*!*/ /*!*/); --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; border-image: initial; --tw-border-opacity: 1; font-weight: 600; color: rgb(102, 102, 102); display: inline-block; font-size: 1.125rem; line-height: 1.75rem; margin-bottom: 1rem; font-family: Roboto, Arial, sans-serif;\">Sau trường hợp của Tú Linh, những NHM đội tuyển bóng chuyền nữ Việt Nam tiếp tục phải lo lắng khi Kiều Trinh cũng đang gặp vấn đề về sức khỏe.</span></p><p style=\"border-width: 0px; border-style: solid; border-color: rgba(229,231,235,var(--tw-border-opacity)); --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: var(--tw-empty,/*!*/ /*!*/); --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; border-image: initial; --tw-border-opacity: 1; margin-bottom: 20px; color: rgb(101, 101, 101); font-size: medium; font-family: Roboto, Arial, sans-serif;\">Ít ngày qua NHM bóng chuyền Việt Nam nhận tin dữ khi Tú Linh dính chấn thương lật cổ chân và chưa biết ngày trở lại. Tuy nhiên mọi chuyện chưa dừng lại ở đó, thêm một ngôi sao quan trọng của đội tuyển cũng đang gặp vấn đề về sức khỏe, đó là Kiều Trinh!</p><p style=\"border-width: 0px; border-style: solid; border-color: rgba(229,231,235,var(--tw-border-opacity)); --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: var(--tw-empty,/*!*/ /*!*/); --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; border-image: initial; --tw-border-opacity: 1; margin-bottom: 20px; color: rgb(101, 101, 101); font-size: medium; font-family: Roboto, Arial, sans-serif;\">Hoa khôi giải bóng chuyền VĐQG 2023 vắng mặt trong trận đấu giao hữu với Đại học TDTT Bắc Ninh hôm qua 5/12, điều đó khiến NHM đặt câu hỏi vì sao? Trên thực tế kể từ khi tập trung đội tuyển, gần 2 tuần nay Hoàng Thị Kiều Trinh thường xuyên vắng mặt trong các buổi tập.</p><p style=\"border-width: 0px; border-style: solid; border-color: rgba(229,231,235,var(--tw-border-opacity)); --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: var(--tw-empty,/*!*/ /*!*/); --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; border-image: initial; --tw-border-opacity: 1; margin-bottom: 20px; color: rgb(101, 101, 101); font-size: medium; font-famil