INSERT INTO `tblposts` (`id`, `PostTitle`, `CategoryId`, `SubCategoryId`, `PostDetails`, `PostingDate`, `UpdationDate`, `Is_Active`, `PostUrl`, `PostImage`, `Ctvid`) VALUES
(24, 'Trụ cột tỏa sáng, chủ nhà Thiên Tân giành HCĐ giải vô địch các CLB thế giới 2023', 14, 14, '<p><span style=\"background-color: initial; color: rgb(41, 41, 41); font-size: 18px; text-align: justify; font-family: roboto, Helvetica, Arial, sans-serif;\">(Kết quả bóng chuyền) - Màn tỏa sáng của Li Yingying, Wang Yizhu hay Wang Yuanyuan đã giúp Ngân hàng Bột Hải Thiên Tân đánh bại Dentil Praia Clube trong trận tranh hạng 3 giải vô địch các CLB thế giới 2023.</span></p><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 18px; line-height: 1.6; text-align: justify; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif;\">Trong trận tranh hạng 3 giải bóng chuyền nữ vô địch các câu lạc bộ thế giới 2023 kết thúc cách đây chưa lâu, đội chủ nhà&nbsp;<strong style=\"margin: 0px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background: 0px 0px;\">Ngân hàng Bột Hải Thiên Tân</strong>&nbsp;- Tianjin Bohai Bank đã vượt qua&nbsp;<strong style=\"margin: 0px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background: 0px 0px;\">Dentil Praia Clube</strong>&nbsp;(Brazil) với tỉ số&nbsp;<strong style=\"margin: 0px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background: 0px 0px;\">3-1 (25-23; 25-20; 17-25; 25-19)</strong>, qua đó chính thức giành tấm huy chương đồng ở giải đấu.</p><div class=\"teads-adCall\" style=\"margin: 0px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif; font-size: 18px;\"></div><figure class=\"expNoEdit\" style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; min-width: 100%; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif; font-size: 18px;\"><a href=\"https://cdn-img.thethao247.vn/origin_842x0/storage/files/btvttth2/2023/12/17/tru-cot-toa-sang-chu-nha-thien-tan-gianh-hcd-giai-vo-dich-cac-clb-the-gioi-2023-374576.jpg\" rel=\"nofollow noopener\" data-caption=\"Đội chủ nhà Ngân hàng Bột Hải Thiên Tân đã có một giải đấu thành công (Ảnh: VolleyballWorld)\" data-at-1366=\"https://cdn-img.thethao247.vn/origin_1366x0/storage/files/btvttth2/2023/12/17/tru-cot-toa-sang-chu-nha-thien-tan-gianh-hcd-giai-vo-dich-cac-clb-the-gioi-2023-374576.jpg\" data-at-1920=\"https://cdn-img.thethao247.vn/origin_1920x0/storage/files/btvttth2/2023/12/17/tru-cot-toa-sang-chu-nha-thien-tan-gianh-hcd-giai-vo-dich-cac-clb-the-gioi-2023-374576.jpg\" style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(27, 149, 224); vertical-align: baseline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; transition: all 0.3s ease 0s; cursor: pointer; display: block;\"><img class=\" lazyloaded\" data-src=\"https://cdn-img.thethao247.vn/origin_842x0/storage/files/btvttth2/2023/12/17/tru-cot-toa-sang-chu-nha-thien-tan-gianh-hcd-giai-vo-dich-cac-clb-the-gioi-2023-374576.jpg\" src=\"https://cdn-img.thethao247.vn/origin_842x0/storage/files/btvttth2/2023/12/17/tru-cot-toa-sang-chu-nha-thien-tan-gianh-hcd-giai-vo-dich-cac-clb-the-gioi-2023-374576.jpg\" width=\"3840\" height=\"2559\" alt=\"Trụ cột tỏa sáng, chủ nhà Thiên Tân giành HCĐ giải vô địch các CLB thế giới 2023 374576\" title=\"\" data-adbro-processed=\"true\" style=\"margin: 0px auto; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; vertical-align: bottom; background: 0px 0px; max-width: 100%; height: auto; display: block;\"></a><figcaption style=\"margin: 0px; padding: 8px 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background: rgb(242, 242, 242); color: rgb(97, 97, 97); text-align: center; font-size: 15.48px;\">Đội chủ nhà Ngân hàng Bột Hải Thiên Tân đã có một giải đấu thành công (Ảnh: VolleyballWorld)</figcaption></figure><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 18px; line-height: 1.6; text-align: justify; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif;\">Thiên Tân đã có sự khởi đầu ấn tượng khi những cái tên trụ cột như Li Yingying, Yuan Xinyue, Wang Yuanyuan hay Wang Yizhu liên tục lên tiếng, giúp Thiên Tân sớm dẫn 2-0 trong trận đấu này.&nbsp;</p><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 18px; line-height: 1.6; text-align: justify; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif;\">Dẫu vậy, chiến thuận liên tục \"dí\" bước 1 libero Meng Zixuan bên phía Thiên Tân của Praia Clube đã phát huy hiệu quả tối đa. Libero sinh năm 1996 này không thể xử lí gọn gàng các cú đập của Tainara và những pha phát bóng như búa bổ của Sofya Kuznetsova, tạo điều kiện để Praia Clube liên tục lên điểm, đưa trận đấu sang set 4.</p><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 18px; line-height: 1.6; text-align: justify; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif;\">Rất may, các cầu thủ của Thiên Tân vẫn chơi rất ổn định ở set đấu sau đó với những miếng đánh ở vị trí số 4, ấn định thắng lợi chung cuộc.</p><div class=\"table-responsive-247\" style=\"margin: 0px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; width: 765px; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif; font-size: 18px;\"><table border=\"1\" style=\"margin: 0px 0px 15px; padding: 5px; list-style: none; outline-style: initial; outline-width: 0px; border: 1px solid rgb(0, 0, 0); vertical-align: middle; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 16px; line-height: 1.9; width: 765px;\"><tbody style=\"margin: 0px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; background: 0px 0px;\"><tr style=\"margin: 0px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: middle; background: 0px 0px;\"><td style=\"margin: 0px; padding: 5px; list-style: none; outline-style: initial; outline-width: 0px; border: 1px solid rgb(0, 0, 0); vertical-align: middle; background: 0px 0px; width: 764px;\"><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: middle; background: 0px 0px; font-size: 18px; line-height: 1.6; text-align: justify;\"><strong style=\"margin: 0px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: middle; background: 0px 0px;\">Set 4: Thiên Tân 25-19 Praia Clube</strong></p><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: middle; background: 0px 0px; font-size: 18px; line-height: 1.6; text-align: justify;\"><strong style=\"margin: 0px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: middle; background: 0px 0px;\">25-19:&nbsp;</strong>Yuan Xinyue ấn định thắng lợi cho Thiên Tân.</p><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: middle; background: 0px 0px; font-size: 18px; line-height: 1.6; text-align: justify;\"><strong style=\"margin: 0px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: middle; background: 0px 0px;\">24-19:&nbsp;</strong>Dobriana Rabadzhieva phát ra ngoài, match-point cho Thiên Tân.</p><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: middle; background: 0px 0px; font-size: 18px; line-height: 1.6; text-align: justi