dding: 0px; list-style: none; border-width: 0px; border-style: initial; max-width: 100%;\"></iframe></div></div></div></div></div></div></div></zone><div data-check-position=\"gamek_detail_position_start\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; font-size: 12px; outline-style: initial; outline-width: 0px;\"></div><div class=\"rightdetail_content detailsmallcontent\" data-field=\"body\" data-role=\"content\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-weight: normal; font-stretch: normal; font-size: 17px; line-height: 23px; font-family: &quot;Times New Roman&quot;; outline-style: initial; outline-width: 0px;\"><p style=\"margin-top: 10.05px; margin-bottom: 10.05px; padding: 0px; list-style: none; border: 0px; color: rgb(51, 51, 51);\">Trong kỳ chuyển nhượng cuối mùa giải 2023,&nbsp;<a class=\"link-inline-content\" href=\"https://gamek.vn/theshy-va-tarzan-tuyen-bo-nghi-ngoi-trong-mua-giai-moi-t1-bi-lien-doi-trach-nhiem-178231216013025432.chn\" target=\"_blank\" title=\"T1\" data-rel=\"follow\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px;\">T1</a>&nbsp;có hai nhiệm vụ quan trọng và họ đã hoàn thành rất tốt: giữ chân các trụ cột và chiêu mộ một Ban huấn luyện thực thụ. Bởi lẽ, bộ ba Zeus - Gumayusi - Keria đã đáo hạn hợp đồng sau khi&nbsp;<a class=\"link-inline-content\" href=\"https://gamek.vn/wbg-bi-t1-nghien-nat-o-tran-chung-ket-cktg-2023-sn-2020-ngoi-khong-cung-bi-va-lay-17823121214234943.chn\" target=\"_blank\" title=\"CKTG 2023\" data-rel=\"follow\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px;\">CKTG 2023</a>&nbsp;kết thúc. Đồng thời, T1 chắc chắn vẫn cần một HLV trưởng thực sự sau khi HLV Bengi rời ghế nóng giữa chừng. Và đội tuyển giàu thành tích nhất làng LMHT đã hoàn tất cả hai yêu cầu này, đặc biệt là còn đón chào sự trở lại của HLV huyền thoại KkOma.</p><p style=\"margin-top: 10.05px; margin-bottom: 10.05px; padding: 0px; list-style: none; border: 0px; color: rgb(51, 51, 51);\">Với một đội tuyển như T1, sự ổn định và thấm nhuần văn hóa đội tuyển là yêu cầu vô cùng quan trọng. Chính vì vậy, T1 hầu như rất ít khi tham gia thị trường chuyển nhượng để bổ sung những cái tên mới. Nếu có, đó cũng từng là thành viên của T1 (Bengi, HLV KkOma, Sky) hay cựu thành viên từ đội trẻ. Trong một số lần T1 tham gia thị trường chuyển nhượng, số thương vụ thành công và thất bại gần như là ngang nhau.</p><figure class=\"VCSortableInPreviewMode\" type=\"Photo\" style=\"margin-right: auto; margin-bottom: 10px; margin-left: auto; padding: 0px; list-style: none; border: 0px; display: inline-block; font-style: italic; flex-direction: column; position: relative; transition: all 0.3s ease-in-out 0s; width: 503px; z-index: 96; visibility: visible; overflow-wrap: break-word; cursor: default; text-align: center; color: rgb(51, 51, 51);\"><div style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; outline-style: initial; outline-width: 0px;\"><a href=\"https://gamek.mediacdn.vn/133514250583805952/2023/12/18/t1-faker-2-17028764355291497255056.jpg\" data-fancybox=\"img-lightbox\" title=\"Họ có sự bổ sung HLV KkOma cho đội hình chính cũng như giữ được bộ sậu cũ\" target=\"_blank\" class=\"detail-img-lightbox\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; cursor: zoom-in; display: block;\"><img data-author=\"\" src=\"https://gamek.mediacdn.vn/thumb_w/640/133514250583805952/2023/12/18/t1-faker-2-17028764355291497255056.jpg\" id=\"img_63638573015470080\" w=\"2048\" h=\"2048\" alt=\"Họ có sự bổ sung HLV KkOma cho đội hình chính cũng như giữ được bộ sậu cũ\" title=\"Họ có sự bổ sung HLV KkOma cho đội hình chính cũng như giữ được bộ sậu cũ\" rel=\"lightbox\" photoid=\"63638573015470080\" data-original=\"https://gamek.mediacdn.vn/133514250583805952/2023/12/18/t1-faker-2-17028764355291497255056.jpg\" type=\"photo\" width=\"\" height=\"\" class=\"lightbox-content\" style=\"margin: 0px auto; padding: 0px; list-style: none; font-size: 0px; color: transparent; vertical-align: top; max-width: 100%; display: inline-block;\"></a></div><figcaption class=\"PhotoCMS_Caption\" style=\"margin: 0px; padding: 5px 8px; list-style: none; border: 0px; min-height: 0px; background: rgb(233, 233, 233);\"><p data-placeholder=\"Nhập chú thích ảnh\" style=\"padding-top: 0px; padding-right: 0px; padding-left: 0px; list-style: none; border: 0px; padding-bottom: 0px !important; font-size: 14px !important;\">Họ có sự bổ sung HLV KkOma cho đội hình chính cũng như giữ được bộ sậu cũ</p></figcaption></figure><p style=\"margin-top: 10.05px; margin-bottom: 10.05px; padding: 0px; list-style: none; border: 0px; color: rgb(51, 51, 51);\">Nhưng mới đây, theo như chính&nbsp;<a class=\"link-inline-content\" href=\"https://gamek.vn/chovy-chi-ra-diem-manh-nhat-cua-faker-khang-dinh-chinh-ban-than-cung-phai-hoc-hoi-dan-anh-178231217121306399.chn\" target=\"_blank\" title=\"Faker\" data-rel=\"follow\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px;\">Faker</a>&nbsp;tiết lộ, T1 có thể vẫn còn 1 thành viên mới chưa lộ diện. Cụ thể, trong một chia sẻ mới đây, Faker đã cho biết:&nbsp;<i style=\"margin: 0px; padding: 0px; list-style: none; border: 0px;\">\"Bây giờ chúng tôi đang có một đội ngũ mới rồi. Và mới đây, chúng tôi cũng đã đến nhà của thành viên mới, cũng như nhà của giám đốc của đội (có thể là Becker - General Manager)\".</i>&nbsp;Như vậy, theo như Faker tiết lộ, toàn đội đã đến nhà của một thành viên mới và người đó sẽ có thể tham gia T1 ở mùa giải tới.</p><div class=\"VCSortableInPreviewMode alignJustify\" data-style=\"align-justify\" data-layout=\"default\" type=\"photo-grid-album\" style=\"margin: 0px auto 15px; padding: 0px; list-style: none; border: 0px; outline-style: initial; outline-width: 0px; font-style: italic; display: flex; flex-direction: column; position: relative; transition: all 0.3s ease-in-out 0s; width: 503px; z-index: 96; visibility: visible; overflow-wrap: break-word; cursor: default; gap: 5px; grid-template-columns: repeat(12, 1fr); grid-template-rows: repeat(12, 1fr); height: unset; color: rgb(51, 51, 51);\"><div class=\"grid-row\" style=\"margin: 0px 0px 5px; padding: 0px; list-style: none; border: 0px; outline-style: initial; outline-width: 0px; width: 503px; display: flex;\"><figure class=\"media-item\" data-originalw=\"2048\" data-originalh=\"1431\" style=\"padding: 0px; list-style: none; border: 0px; display: inline-block; margin-block: 0px; margin-inline: 0px; overflow: hidden; user-select: none; width: calc(50% - 2.5px);\"><a href=\"https://gamek.mediacdn.vn/133514250583805952/2023/12/18/t1-faker-3-17028766029351551134457.jpg\" data-fancybox=\"img-lightbox\" title=\"Faker vô tình tiết lộ T1 đang có một thành viên mới\" target=\"_blank\" class=\"detail-img-lightbox\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; cursor: zoom-in; display: block; width: 249px; height: 173.975px; object-fit: cover;\"><img src=\"https://gamek.mediacdn.vn/133514250583805952/2023/12/18/t1-faker-3-17028766029351551134457.jpg\" data-originalw=\"2048\" data-originalh=\"1431\" data-original=\"https://gamek.mediacdn.vn/133514250583805952/2023/12/18/t1-faker-3-17028766029351551134457.jpg\" data-row=\"0\" data-id=\"63638924095148032\" class=\"lightbox-content\" style=\"margin: 0px; padding: 0px; list-style: none; font-size: 0px; color: transparent; max-width: 100%; width: 249px; height: 173.975px; object-fit: cover; display: block;\"></a></figure><figure class=\"media-item\" data-originalw=\"2048\" data-originalh=\"1431\" style=\"padding: 0px; list-style: none; border: 0px; display: inline-block; margin-block: 0px; margin-inline: 0px; overflow: hidden; margin-left: 5px; user-select: none; width: calc(50% - 2.5px);\"><a href=\"https://gamek.mediacdn.vn/133514250583805952/2023/12/18/t1-faker-4-1702876602970284595143.jpg\" data-fancybox=\"img-lightbox\" title=\"Faker vô tình tiết lộ T1 đang có một thành viên mới\" target=\"_blank\" class=\"detail-img-lightbox\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; cursor: zoom-in; display: block; width: 249px; height: 173.975px; object-fit: cover;\"><img src=\"https://gamek.mediacdn.vn/133514250583805952/2023/12/18/t1-faker-4-1702876602970284595143.jpg\" data-originalw=\"2048\" data-originalh=\"1431\" data-original=\"https://gamek.mediacdn.vn/133514250583805952/2023/12/18/t1-faker-4-1702876602970284595143.jpg\" data-row=\"0\" data-id=\"63638924076929024\" class=\"lightbox-content\" style=\"margin: 0px; padding: 0px; list-style: none; font-size: 0px; color: transparent; max-width: 100%; width: 249px; height: 173.975px; object-fit: cover; display: block;\"></a></figure></div><figcaption class=\"PhotoCMS_Caption\" style=\"margin: 0px; padding: 5px 8px; list-style: none; border: 0px; min-height: 0px; background: rgb(233, 233, 233); grid-column: 1 / 13;\"><p data-placeholder=\"Nhập chú thích ảnh\" style=\"padding-top: 0px; padding-right: 0px; padding-left: 0px; list-style: none; border: 0px; padding-bottom: 0px !important; font-size: 14px !important;\">Faker vô tình tiết lộ T1 đang có một thành viên mới</p></figcaption></div><p style=\"margin-top: 10.05px; margin-bottom: 10.05px; padding: 0px; list-style: none; border: 0px; color: rgb(51, 51, 51);\">Nhiều dân mạng đã đưa ra rất nhiều sự đồn đoán. Ở kỳ chuyển nhượng vừa qua, T1 có bổ sung Rekkles và HLV KkOma là 2 \"người mới\" của đội. Nhưng thông thường, Faker sẽ gọi thẳng tên của vị HLV thân thiết. Hơn nữa, sau khi vị HLV tái ngộ T1, chính Faker cũng cho biết toàn đội đã sang thăm nhà của HLV KkOma và gia đình anh. Trong khi đó, Rekkles chỉ vừa chuyển sang LCK và chưa có bất kỳ bằng chứng nào cho thấy anh đã kịp mua 1 căn nhà ở Seoul. Như vậy, có thể đó là 1 nhân vật còn chưa được công bố.</p><figure class=\"VCSortableInPreviewMode small-img\" type=\"Photo\" style=\"margin-right: auto; margin-bottom: 10px; margin-left: auto; padding: 0px; list-style: none; border: 0px; display: inline-block; font-style: italic; flex-direction: column; position: relative; transition: all 0.3s ease-in-out 0s; width: 503px; z-index: 96; visibility: visible; overflow-wrap: break-word; cursor: default; text-align: center; color: rgb(51, 51, 51);\"><div style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; outline-style: initial; outline-width: 0px;\"><a href=\"https://gamek.mediacdn.vn/133514250583805952/2023/12/18/t1-faker-5-1702876435361552861023.png\" data-fancybox=\"img-lightbox\" title=\"Khán giả bày tỏ sự nghi ngờ cũng như đặt ra nhiều giả thuyết về thành viên mới\" target=\"_blank\" class=\"detail-img-lightbox\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; cursor: zoom-in; display: block;\"><img data-author=\"\" src=\"https://gamek.mediacdn.vn/133514250583805952/2023/12/18/t1-faker-5-1702876435361552861023.png\" id=\"img_63638572204183552\" w=\"604\" h=\"297\" alt=\"Khán giả bày tỏ sự nghi ngờ cũng như đặt ra nhiều giả thuyết về thành viên mới\" title=\"Khán giả bày tỏ sự nghi ngờ cũng như đặt ra nhiều giả thuyết về thành viên mới\" rel=\"lightbox\" photoid=\"63638572204183552\" data-original=\"https://gamek.mediacdn.vn/133514250583805952/2023/12/18/t1-faker-5-1702876435361552861023.png\" type=\"photo\" width=\"\" height=\"\" class=\"lightbox-content\" style=\"margin: 0px auto; padding: 0px; list-style: none; font-size: 0px; color: transparent; vertical-align: top; max-width: 100%; display: inline-block;\"></a></div><figcaption class=\"PhotoCMS_Caption\" style=\"margin: 0px; padding: 5px 8px; list-style: none; border: 0px; min-height: 0px; background: rgb(233, 233, 233);\"><p data-placeholder=\"Nhập chú thích ảnh\" style=\"padding-top: 0px; padding-right: 0px; padding-left: 0px; list-style: none; border: 0px; padding-bottom: 0px !important; font-size: 14px !important;\">Khán giả bày tỏ sự nghi ngờ cũng như đặt ra nhiều giả thuyết về thành viên mới</p></figcaption></figure><p style=\"margin-top: 10.05px; margin-bottom: 10.05px; padding: 0px; list-style: none; border: 0px; color: rgb(51, 51, 51);\">Tuy rằng Faker không tiết lộ cụ thể là ai, nhưng có thể đó là một nhân vật tầm cỡ hoặc sẽ gây bất ngờ cho khán giả. Mùa giải mới đang đến gần và chắc chắn người hâm mộ có thể kỳ vọng T1 sẽ mang đến những bất ngờ trong năm mới.</p><div id=\"admzone508553\" class=\"wp100 mt-10\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; outline-style: initial; outline-width: 0px; color: rgb(51, 51, 51); display: inline-block; width: 503px;\"><div id=\"zone-508553\" style=\"margin: 0px; padding: 10px 0px 0px; list-style: none; border: 0px; outline-style: initial; outline-width: 0px;\"><div id=\"share-jny24v1r\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; outline-style: initial; outline-width: 0px;\"><div id=\"placement-khjpg0rn\" revenue=\"cpm\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; outline-style: initial; outline-width: 0px;\"><div id=\"banner-508553-khjpg0s0\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; outline-style: initial; outline-width: 0px; min-height: 0px; min-width: 0px;\"><div id=\"slot-1-508553-khjpg0s0\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; outline-style: initial; outline-width: 0px;\"><div id=\"ssppagebid_8304\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; outline-style: initial; outline-width: 0px;\"></div></div></div></div></div></div></div></div></h2><div class=\"rightdetail_content detailsmallcontent\" data-field=\"body\" data-role=\"content\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; 