(38, '\"Super team\" của LCK tặng tiền cho ai làm fan, cộng đồng tranh cãi lý do đằng sau', 18, 21, '<h2 data-field=\"sapo\" data-role=\"sapo\" style=\"margin-top: 0px; margin-bottom: 20px; padding: 0px; list-style: none; border: 0px; font-size: 15px; color: rgb(82, 80, 80); font-weight: bold; font-family: Tahoma;\"><span style=\"color: rgb(51, 51, 51); font-family: &quot;Times New Roman&quot;; font-size: 17px; font-weight: 400;\">Đối với&nbsp;</span><a class=\"link-inline-content\" href=\"https://gamek.vn/mua-giai-chua-bat-dau-t1oner-da-co-man-gay-cuc-khet-tuyen-chien-ca-lang-lmht-178231215014819797.chn\" target=\"_blank\" title=\"LMHT\" data-rel=\"follow\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; font-size: 17px; font-family: &quot;Times New Roman&quot;; font-weight: 400; background-color: rgb(255, 255, 255);\">LMHT</a><span style=\"color: rgb(51, 51, 51); font-family: &quot;Times New Roman&quot;; font-size: 17px; font-weight: 400;\">&nbsp;chuyên nghiệp nói riêng và Esports nói chung, khán giả là yếu tố không thể thiếu, nếu không muốn nói là quan trọng nhất. Thậm chí, việc sở hữu một lượng khán giả đủ lớn còn có thể quyết định sự tồn tại và giá trị của một đội tuyển. Bởi lẽ, người chơi LMHT có thể không thực sự quá nhiều nhưng nếu một trận đấu chỉ thu hút khoảng 200k người xem thì có nghĩa đó là một trận đấu kém hấp dẫn. Đơn cử như&nbsp;</span><a class=\"link-inline-content\" href=\"https://gamek.vn/theshy-va-tarzan-tuyen-bo-nghi-ngoi-trong-mua-giai-moi-t1-bi-lien-doi-trach-nhiem-178231216013025432.chn\" target=\"_blank\" title=\"T1\" data-rel=\"follow\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; font-size: 17px; font-family: &quot;Times New Roman&quot;; font-weight: 400; background-color: rgb(255, 255, 255);\">T1</a><span style=\"color: rgb(51, 51, 51); font-family: &quot;Times New Roman&quot;; font-size: 17px; font-weight: 400;\">&nbsp;khi bất kỳ trận đấu nào của Faker và các đồng đội đều sẽ dễ dàng chiếm vị trí trong Top lượng view cao nhất của giải đấu mà họ tham dự.</span></h2><h2 data-field=\"sapo\" data-role=\"sapo\" style=\"margin-top: 0px; margin-bottom: 20px; padding: 0px; list-style: none; border: 0px; font-size: 15px; color: rgb(82, 80, 80); font-weight: bold; font-family: Tahoma;\"><p style=\"margin-top: 10.0469px; margin-bottom: 10.0469px; padding: 0px; list-style: none; border: 0px; font-size: 17px; color: rgb(51, 51, 51); font-family: &quot;Times New Roman&quot;; font-weight: 400;\">Đối với các đội có lực mạnh ở cả danh tiếng, lịch sử hay tài chính, việc có lượng fan lớn là chuyện không còn xa lạ, ví dụ như SKT T1/T1 hay Gen.G ... Tuy nhiên, cũng có không ít đội tuyển có sức mạnh tài chính cũng như một đội hình trong hàng top của khu vực, thậm chí là của làng LMHT nói chung, nhưng lượng fan trên thực tế lại không đủ nhiều nếu so với những top team khác. Những đội tuyển này, đa phần đều do còn nhiều hạn chế trong việc truyền thông hình ảnh cũng như thành tích. Và tiêu biểu cho trường hợp này chính là Hanwha Life Esports - đội đang được xem là sở hữu một \"super team\" rất chất lượng tại LCK.</p><figure class=\"VCSortableInPreviewMode\" type=\"Photo\" style=\"margin-right: auto; margin-bottom: 10px; margin-left: auto; padding: 0px; list-style: none; border: 0px; font-size: 17px; display: inline-block; font-style: italic; flex-direction: column; position: relative; transition: all 0.3s ease-in-out 0s; width: 503px; z-index: 96; visibility: visible; overflow-wrap: break-word; cursor: default; text-align: center; color: rgb(51, 51, 51); font-family: &quot;Times New Roman&quot;; font-weight: 400;\"><div style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; outline-style: initial; outline-width: 0px;\"><a href=\"https://gamek.mediacdn.vn/133514250583805952/2023/12/16/hle-fan-lck-2-17027220330211879527566.jpg\" data-fancybox=\"img-lightbox\" title=\"HLE có lực mạnh nhưng fan không đông như T1\" target=\"_blank\" class=\"detail-img-lightbox\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; cursor: zoom-in; display: block;\"><img data-author=\"\" src=\"https://gamek.mediacdn.vn/thumb_w/640/133514250583805952/2023/12/16/hle-fan-lck-2-17027220330211879527566.jpg\" id=\"img_63314767323504640\" w=\"2048\" h=\"1378\" alt=\"HLE có lực mạnh nhưng fan không đông như T1\" title=\"HLE có lực mạnh nhưng fan không đông như T1\" rel=\"lightbox\" photoid=\"63314767323504640\" data-original=\"https://gamek.mediacdn.vn/133514250583805952/2023/12/16/hle-fan-lck-2-17027220330211879527566.jpg\" type=\"photo\" width=\"\" height=\"\" class=\"lightbox-content\" style=\"margin: 0px auto; padding: 0px; list-style: none; font-size: 0px; color: transparent; vertical-align: top; max-width: 100%; display: inline-block;\"></a></div><figcaption class=\"PhotoCMS_Caption\" style=\"margin: 0px; padding: 5px 8px; list-style: none; border: 0px; min-height: 0px; background: rgb(233, 233, 233);\"><p data-placeholder=\"Nhập chú thích ảnh\" style=\"padding-top: 0px; padding-right: 0px; padding-left: 0px; list-style: none; border: 0px; padding-bottom: 0px !important; font-size: 14px !important;\">HLE có lực mạnh nhưng fan không đông như T1</p></figcaption></figure><span style=\"color: rgb(51, 51, 51); font-family: &quot;Times New Roman&quot;; font-size: 17px; font-weight: 400;\"></span><p style=\"margin-top: 10.0469px; margin-bottom: 10.0469px; padding: 0px; list-style: none; border: 0px; font-size: 17px; color: rgb(51, 51, 51); font-family: &quot;Times New Roman&quot;; font-weight: 400;\">Mới đây, HLE đã có một nước đi rất bất ngờ và táo bạo. Cụ thể, theo một thông báo mới nhất trên trang của đội tuyển này, kể từ mùa sau, mỗi khi&nbsp;<a class=\"link-inline-content\" href=\"https://gamek.vn/cung-xay-dung-super-team-hle-lai-that-bai-hoan-toan-so-voi-geng-chinh-khan-gia-chi-ra-nguyen-nhan-178230830113804803.chn\" target=\"_blank\" title=\"HLE\" data-rel=\"follow\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px;\">HLE</a>đạt được một mục tiêu trong mùa giải thì CĐV sẽ được thưởng một khoản tiền theo tỉ lệ nhất định được quy định trong gói membership. Cụ thể, với mỗi thành tích vào được vòng playoffs các giải đấu như LCK Mùa Xuân, Mùa Hè hay giành suất dự CKTG 2024, mỗi fan của HLE sẽ được thưởng 0.3%.</p><div id=\"content_ads_161\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; font-size: 17px; outline-style: initial; outline-width: 0px; color: rgb(51, 51, 51); font-family: &quot;Times New Roman&quot;; font-weight: 400;\"><div id=\"ads_161\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; outline-style: initial; outline-width: 0px;\"></div></div><p style=\"margin-top: 10.0469px; margin-bottom: 10.0469px; padding: 0px; list-style: none; border: 0px; font-size: 17px; color: rgb(51, 51, 51); font-family: &quot;Times New Roman&quot;; font-weight: 400;\">Riêng với thành tích vào được trận chung kết của CKTG, mỗi fan của HLE sẽ được thưởng 0.6%. Số tiền này dựa trên gói membership của người hâm mộ HLE sẽ mua. Và tổng số tiền mà fan HLE có thể nhận được là 9000 won (khoảng 170k VND).</p><figure class=\"VCSortableInPreviewMode\" type=\"Photo\" style=\"margin-right: auto; margin-bottom: 10px; margin-left: auto; padding: 0px; list-style: none; border: 0px; font-size: 17px; display: inline-block; font-style: italic; flex-direction: column; position: relative; transition: all 0.3s ease-in-out 0s; width: 503px; z-index: 96; visibility: visible; overflow-wrap: break-word; cursor: default; text-align: center; color: rgb(51, 51, 51); font-family: &quot;Times New Roman&quot;; font-weight: 400;\"><div style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; outline-style: initial; outline-width: 0px;\"><a href=\"https://gamek.mediacdn.vn/133514250583805952/2023/12/16/hle-fan-lck-4-1702722032990635772645.jpg\" data-fancybox=\"img-lightbox\" title=\"HLE tung gói bảo hiểm cho fan có thể có tiền nếu đội nhà giành kết quả tốt\" target=\"_blank\" class=\"detail-img-lightbox\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; cursor: zoom-in; display: block;\"><img data-author=\"\" src=\"https://gamek.mediacdn.vn/thumb_w/640/133514250583805952/2023/12/16/hle-fan-lck-4-1702722032990635772645.jpg\" id=\"img_63314767196999680\" w=\"1080\" h=\"664\" alt=\"HLE tung gói bảo hiểm cho fan có thể có tiền nếu đội nhà giành kết quả tốt\" title=\"HLE tung gói bảo hiểm cho fan có thể có tiền nếu đội nhà giành kết quả tốt\" rel=\"lightbox\" photoid=\"63314767196999680\" data-original=\"https://gamek.mediacdn.vn/133514250583805952/2023/12/16/hle-fan-lck-4-1702722032990635772645.jpg\" type=\"photo\" width=\"\" height=\"\" class=\"lightbox-content\" style=\"margin: 0px auto; padding: 0px; list-style: none; font-size: 0px; color: transparent; vertical-align: top; max-width: 100%; display: inline-block;\"></a></div><figcaption class=\"PhotoCMS_Caption\" style=\"margin: 0px; padding: 5px 8px; list-style: none; border: 0px; min-height: 0px; background: rgb(233, 233, 233);\"><p data-placeholder=\"Nhập chú thích ảnh\" style=\"padding-top: 0px; padding-right: 0px; padding-left: 0px; list-style: none; border: 0px; padding-bottom: 0px !important; font-size: 14px !important;\">HLE tung gói bảo hiểm cho fan có thể có tiền nếu đội nhà giành kết quả tốt</p></figcaption></figure><span style=\"color: rgb(51, 51, 51); font-family: &quot;Times New Roman&quot;; font-size: 17px; font-weight: 400;\"></span><p style=\"margin-top: 10.0469px; margin-bottom: 10.0469px; padding: 0px; list-style: none; border: 0px; font-size: 17px; color: rgb(51, 51, 51); font-family: &quot;Times New Roman&quot;; font-weight: 400;\">Thoạt nghe, tưởng chừng như người chơi sẽ nhận được quyền lợi quen thuộc như khi sở hữu gói membership. Nhưng trên thực tế, gói này chỉ áp dụng cho những ai mua mua gói \"Bảo hiểm tiết kiệm \" của HLE + đi kèm content tuyển thủ và các quyền lợi. Đến đây thì nhiều game thủ nhận định: HLE chỉ đơn giản là thay đổi gói membership quen thuộc thành một gói bảo hiểm và người hâm mộ sẽ được nhận quyền lợi tương tự như khi mua bảo hiểm sức khỏe hay những gói bảo hiểm tương tự.</p><figure class=\"VCSortableInPreviewMode small-img\" type=\"Photo\" style=\"margin-right: auto; margin-bottom: 10px; margin-left: auto; padding: 0px; list-style: none; border: 0px; font-size: 17px; display: inline-block; font-style: italic; flex-direction: column; position: relative; transition: all 0.3s ease-in-out 0s; width: 503px; z-index: 96; visibility: visible; overflow-wrap: break-word; cursor: default; text-align: center; color: rgb(51, 51, 51); font-family: &quot;Times New Roman&quot;; font-weight: 400;\"><div style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; outline-style: initial; outline-width: 0px;\"><a href=\"https://gamek.mediacdn.vn/133514250583805952/2023/12/16/hle-fan-lck-3-17027222299451035559328.png\" data-fancybox=\"img-lightbox\" title=\"Khán giả tranh cãi về chương trình này của HLE\" target=\"_blank\" class=\"detail-img-lightbox\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; cursor: zoom-in; display: block;\"><img data-author=\"\" src=\"https://gamek.mediacdn.vn/133514250583805952/2023/12/16/hle-fan-lck-3-17027222299451035559328.png\" id=\"img_63315180118245376\" w=\"547\" h=\"850\" alt=\"Khán giả tranh cãi về chương trình này của HLE\" title=\"Khán giả tranh cãi về chương trình này của HLE\" rel=\"lightbox\" photoid=\"63315180118245376\" data-original=\"https://gamek.mediacdn.vn/133514250583805952/2023/12/16/hle-fan-lck-3-17027222299451035559328.png\" type=\"photo\" width=\"\" height=\"\" class=\"lightbox-content\" style=\"margin: 0px auto; padding: 0px; list-style: none; font-size: 0px; color: transparent; vertical-align: top; max-width: 100%; display: inline-block;\"></a></div><figcaption class=\"PhotoCMS_Caption\" style=\"margin: 0px; padding: 5px 8px; list-style: none; border: 0px; min-height: 0px; background: rgb(233, 233, 233);\"><p data-placeholder=\"Nhập chú thích ảnh\" style=\"padding-top: 0px; padding-right: 0px; padding-left: 0px; list-style: none; border: 0px; padding-bottom: 0px !important; font-size: 14px !important;\">Khán giả tranh cãi về chương trình này của HLE</p></figcaption></figure><span style=\"color: rgb(51, 51, 51); font-family: &quot;Times New Roman&quot;; font-size: 17px; font-weight: 400;\"></span><p style=\"margin-top: 10.0469px; margin-bottom: 10.0469px; padding: 0px; list-style: none; border: 0px; font-size: 17px; color: rgb(51, 51, 51); font-family: &quot;Times New Roman&quot;; font-weight: 400;\">Dù rằng chương trình mang đúng phong cách của chủ sở hữu HLE (tập đoàn bảo hiểm Hanwha Life ) nhưng vẫn khiến nhiều người tranh cãi, nhất là khi giá của gói bảo hiểm vẫn chưa được công bố. Nhưng dù vậy, có lẽ nếu ở một mức giá chấp nhận được cũng như đội hình HLE thi đấu tốt, thì fan cũng sẽ vui vẻ móc hầu bao mà thôi.</p><div id=\"admzone508553\" class=\"wp100 mt-10\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; font-size: 17px; outline-style: initial; outline-width: 0px; color: rgb(51, 51, 51); font-family: &quot;Times New Roman&quot;; font-weight: 400;\"><div id=\"zone-508553\" style=\"margin: 0px; padding: 10px 0px 0px; list-style: none; border: 0px; outline-style: initial; outline-width: 0px;\"><div id=\"share-jny24v1r\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; outline-style: initial; outline-width: 0px;\"><div id=\"placement-khjpg0rn\" revenue=\"cpm\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; outline-style: initial; outline-width: 0px;\"><div id=\"banner-508553-khjpg0s0\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; outline-style: initial; outline-width: 0px; min-height: 0px; min-width: 0px;\"><div id=\"slot-1-508553-khjpg0s0\" style=\"margin: 0px; padding: 0px; list-style: none; border: 0px; outline-style: initial; outline-width: 0px;\"><div id=\"ssppagebid_8304\" style=\"margin: 0px; padding: 0px; list-style: none; 