(39, '‘Đại đế’ Viktor Axelsen lập kỷ lục tại giải cầu lông World Tour Finals', 16, 17, '<div class=\"sticky_social\" style=\"margin: 0px 0px 0px -65px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; position: sticky; top: 150px; width: 65px; height: 210px; font-family: roboto, Helvetica, Arial, sans-serif;\"><ul class=\"list_social_left\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background: 0px 0px;\"><div class=\"sticky_social\" style=\"margin: 0px 0px 0px -65px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; position: sticky; top: 150px; width: 65px; height: 210px;\"><ul class=\"list_social_left\" style=\"margin-right: 0px; margin-left: 0px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background: 0px 0px;\"><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 18px; line-height: 1.6; text-align: justify; color: rgb(17, 17, 17);\">Tay vợt số 1 thế giới Viktor Axelsen xuất sắc hạ đại diện chủ nhà Shi Yuqi tại&nbsp;<a class=\"\" href=\"https://thethao247.vn/460-ket-qua-cau-long-tai-tzu-ying-vs-carolina-marin-15h30-ngay-17-12-d308621.html\" target=\"_blank\" style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(27, 149, 224); vertical-align: baseline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; transition: all 0.3s ease 0s; cursor: pointer; display: inline;\">chung kết giải cầu lông BWF World Tour Finals 2023</a>. Tỉ số trận đấu lần lượt là 21-11, 21-12 nghiêng về Axelsen.</p><div class=\"teads-adCall\" style=\"margin: 0px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(17, 17, 17); font-size: 18px;\"></div><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 18px; line-height: 1.6; text-align: justify; color: rgb(17, 17, 17);\">Người khổng lồ Đan Mạch áp đảo trong mọi tình huống xử lý. Những pha nhảy đập dọc dây uy lực của Axelsen dường như không thể bị ngăn cản. Shi Yuqi nhận được sự cổ vũ của đông đảo khán giả Hàng Châu nhưng không thể tạo nên bất ngờ.</p><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 18px; line-height: 1.6; text-align: justify; color: rgb(17, 17, 17);\">Chức vô địch này đánh dấu năm thứ 3 liên tiếp Viktor Axelsen xưng vương tại giải đấu danh giá này.&nbsp;<strong style=\"margin: 0px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background: 0px 0px;\">Chưa từng có tay vợt nào trong lịch sử cầu lông sở hữu 3 danh hiệu World Tour Finals liên tiếp như “Đại đế”.&nbsp;</strong>Trước đó, anh đã nâng cúp vào các năm 2016, 2017, 2021 và 2022.</p><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 18px; line-height: 1.6; text-align: justify; color: rgb(17, 17, 17);\">Với kết quả này, vị trí số 1 thế giới chắc chắn nằm trong tay của Axelsen sau khi mùa giải 2023 kết thúc. Anh hiện đang giữ vị trí đỉnh bảng BWF liên tục trong 107 tuần vừa qua.&nbsp;</p></ul></div></ul></div>', '2023-12-19 15:22:26', '2023-12-19 15:23:07', 0, '‘Đại-đế’-Viktor-Axelsen-lập-kỷ-lục-tại-giải-cầu-lông-World-Tour-Finals', 'b6d073a52bf802a8199e70ff36dcee9f.jpg', 0),
(40, '‘Đại đế’ Viktor Axelsen lập kỷ lục tại giải cầu lông World Tour Finals', 16, 17, '<p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 18px; line-height: 1.6; text-align: justify; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif;\">Tay vợt số 1 thế giới Viktor Axelsen xuất sắc hạ đại diện chủ nhà Shi Yuqi tại&nbsp;<a class=\"\" href=\"https://thethao247.vn/460-ket-qua-cau-long-tai-tzu-ying-vs-carolina-marin-15h30-ngay-17-12-d308621.html\" target=\"_blank\" style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(27, 149, 224); vertical-align: baseline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; transition: all 0.3s ease 0s; cursor: pointer; display: inline;\">chung kết giải cầu lông BWF World Tour Finals 2023</a>. Tỉ số trận đấu lần lượt là 21-11, 21-12 nghiêng về Axelsen.</p><div class=\"teads-adCall\" style=\"margin: 0px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif; font-size: 18px;\"></div><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 18px; line-height: 1.6; text-align: justify; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif;\">Người khổng lồ Đan Mạch áp đảo trong mọi tình huống xử lý. Những pha nhảy đập dọc dây uy lực của Axelsen dường như không thể bị ngăn cản. Shi Yuqi nhận được sự cổ vũ của đông đảo khán giả Hàng Châu nhưng không thể tạo nên bất ngờ.</p><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 18px; line-height: 1.6; text-align: justify; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif;\">Chức vô địch này đánh dấu năm thứ 3 liên tiếp Viktor Axelsen xưng vương tại giải đấu danh giá này.&nbsp;<strong style=\"margin: 0px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background: 0px 0px;\">Chưa từng có tay vợt nào trong lịch sử cầu lông sở hữu 3 danh hiệu World Tour Finals liên tiếp như “Đại đế”.&nbsp;</strong>Trước đó, anh đã nâng cúp vào các năm 2016, 2017, 2021 và 2022.</p><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 18px; line-height: 1.6; text-align: justify; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif;\">Với kết quả này, vị trí số 1 thế giới chắc chắn nằm trong tay của Axelsen sau khi mùa giải 2023 kết thúc. Anh hiện đang giữ vị trí đỉnh bảng BWF liên tục trong 107 tuần vừa qua.&nbsp;<br></p><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 18px; line-height: 1.6; text-align: justify; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif;\">Trả lời phỏng vấn sau trận chung kết, Viktor Axelsen bày tỏ sự vui mừng:&nbsp;</p><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 18px; line-height: 1.6; text-align: justify; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif;\"><em style=\"margin: 0px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background: 0px 0px;\">“Mùa giải năm nay của tôi thật sự đáng kinh ngạc. Mặc dù vẫn có những trục trặc ở giai đoạn đầu mùa nhưng nhìn chung tôi vẫn vượt qua được. Một vận động viên giỏi sẽ biết cách đứng dậy và hồi phục sau những trải nghiệm đáng thất vọng. Và đó là điều tôi đã làm được. Tôi đã giành được một số danh hiệu lớn nên tôi rất hạnh phúc.”</em></p><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 18px; line-height: 1.6; text-align: justify; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif;\">Anh cũng không quên gửi lời cảm ơn đến đối thủ Shi Yuqi với những nỗ lực tuyệt vời trong trận chung kết cảm xúc. Đại diện chủ nhà có một trận đấu tốt, tuy nhiên Axelsen trong một ngày chơi đúng phong độ đã không cho Shi Yuqi bất cứ cơ hội nào để chống trả.</p><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 18px; line-height: 1.6; text-align: justify; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif;\">Tay vợt số 1 thế giới sẽ bước vào vào kỳ nghỉ ngắn hạn trước khi tham dự giải Super 1000 đầu tiên trong năm mới tại Malaysia, diễn ra từ ngày 9/1 đến 14/1.&nbsp;<a class=\"\" href=\"https://thethao247.vn/460-thuc-hu-nguyen-thuy-linh-bo-giai-cau-long-danh-gia-nam-2024-d308418.html\" target=\"_blank\" style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(27, 149, 224); vertical-align: baseline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; transition: all 0.3s ease 0s; cursor: pointer; display: inline;\">Tay vợt Nguyễn Thùy Linh</a>&nbsp;cũng dự kiến tranh tài tại giải đấu này. Nhưng cô đã rút lui vào phút chót với những tính toán riêng.</p>', '2023-12-19 15:23:37', NULL, 1, '‘Đại-đế’-Viktor-Axelsen-lập-kỷ-lục-tại-giải-cầu-lông-World-Tour-Finals', 'b6d073a52bf802a8199e70ff36dcee9f.jpg', 0),
(41, 'Qua mặt huyền thoại Lee Chong Wei, số 1 thế giới Axelsen trở thành tay vợt thành công nhất giải cầu lông Finals', 16, 17, '<p><span style=\"color: rgb(101, 101, 101); font-family: Roboto, Arial, sans-serif; font-size: 16px;\">Bắt đầu World Tour Finals 2023 với vẻ căng thẳng và áp lực khi thua Shi Yu Qi sít sao ở bảng A, Viktor Axelsen đã dễ dàng trở thành một tay vợt khác hẳn, lúc cả hai thi đấu trong trận chung kết. Giống như những gì \"chú lính chì dũng cảm\" đã làm trong hai trận đấu vòng bảng tiếp theo với Kodai Naraoka và Anthony Sinisuka Ginting cùng trận bán kết với Anders Antonsen, cứ như thể Axelsen đã \"bật công tắc\". Không có sự ngập ngừng, không có sự nghi ngờ bản thân, không có sự khó chịu về bản thân; chỉ là sự thống trị tàn nhẫn từ những cuộc đan cầu đầu tiên của số 1 cầu lông thế giới nam, ngôi sao Trung Quốc Shi Yu Qi bị gạt sang một bên trong 49 phút với thất bại dễ dàng 11-21, 12-21.<br></span><span style=\"color: rgb(101, 101, 101); font-family: Roboto, Arial, sans-serif; font-size: 16px;\">Axelsen rõ ràng biết rằng World Tour Finals rất đặc biệt, vì chính tại sự kiện này (hoặc phiên bản trước đó của nó, World Superseries Finals năm 2016), anh đã cắt đứt chuỗi thua ở các trận tranh danh hiệu. Danh hiệu thứ 5 ở Finals và danh hiệu thứ 3 liên tiếp trong 4 trận chung kết liên tiếp đã giúp ngôi sao Đan Mạch vượt lên trên huyền thoại Lee Chong Wei của Malaysia với tư cách là tay vợt đánh đơn thành công nhất trong lịch sử Finals.<br></span><span style=\"color: rgb(101, 101, 101); font-family: Roboto, Arial, sans-serif; font-size: 16px;\">Nhà vô địch World Tour Finals 2023 chia sẻ: “</span><em style=\"border-width: 0px; border-style: solid; border-color: rgba(229,231,235,var(--tw-border-opacity)); --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: var(--tw-empty,/*!*/ /*!*/); --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; border-image: initial; --tw-border-opacity: 1; color: rgb(101, 101, 101); font-family: Roboto, Arial, sans-serif; font-size: 16px;\">Tôi cảm thấy vô cùng tự hào nhưng cũng vô cùng mệt mỏi. Giải đấu này rất đặc biệt đối với tôi – danh hiệu lớn đầu tiên của tôi là vào năm 2016, nơi tôi đã vượt qua rất nhiều nghi ngờ và một loại rào cản để bắt đầu chiến thắng, vì vậy việc giành chiến thắng ở đây một lần nữa có ý nghĩa thực sự đặc biệt đối với tôi. Đây là lần thứ 5 tôi giành được danh hiệu cuối năm này nên vô cùng đặc biệt</em><span style=\"color: rgb(101, 101, 101); font-family: Roboto, Arial, sans-serif; font-size: 16px;\">”.<br></span><span style=\"color: rgb(101, 101, 101); font-family: Roboto, Arial, sans-serif; font-size: 16px;\">Khi được hỏi về khởi đầu của anh ấy tại giải đấu và cách nó kết thúc, cả hai đều chống lại cùng một đối thủ, Axelsen nhớ rằng điều đó cũng đã xảy ra: “</span><em style=\"border-width: 0px; border-style: solid; border-color: rgba(229,231,235,var(--tw-border-opacity)); --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: var(--tw-empty,/*!*/ /*!*/); --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; border-image: initial; --tw-border-opacity: 1; color: rgb(101, 101, 101); font-family: Roboto, Arial, sans-serif; font-size: 16px;\">Tôi nghĩ có lẽ vào năm 2017 tôi cũng đã thua anh ấy ở vòng bảng và cuối cùng lại giành chiến thắng trong lần chạm trán tiếp theo. May mắn thay, tôi đã lọt vào bán kết và giải đấu này, nếu bạn thực sự dẻo dai về thể chất và tinh thần, bạn có thể có cơ hội thứ hai và tôi đã nắm bắt được điều đó và tôi tự hào về điều đó</em><span style=\"color: rgb(101, 101, 101); font-family: Roboto, Arial, sans-serif; font-size: 16px;\">\".</span><br></p>', '2023-12-19 15:25:32', NULL, 1, 'Qua-mặt-huyền-thoại-Lee-Chong-Wei,-số-1-thế-giới-Axelsen-trở-thành-tay-vợt-thành-công-nhất-giải-cầu-lông-Finals', 'f5bf194b5dabaeeae0109f12303d81d9.jpg', 0);
INSERT INTO `tblposts` (`id`, `PostTitle`, `CategoryId`, `SubCategoryId`, `PostDetails`, `PostingDate`, `UpdationDate`, `Is_Active`, `PostUrl`, `PostImage`, `Ctvid`) VALUES
(42, 'Phá kỷ lục SEA Games, Phạm Thanh Bảo tặng huy chương cho người bà quá cố', 17, 19, '<h2 class=\"detail-sapo\" data-role=\"sapo\" style=\"-webkit-font-smoothing: antialiased; text-rendering: geometricprecision; margin-top: 0px; margin-bottom: 24px; font-weight: 700; font-size: 17px; line-height: 30px; color: rgb(34, 34, 34); font-family: Roboto;\">Tối 7-5, kình ngư Phạm Thanh Bảo xuất sắc thiết lập kỷ lục SEA Games mới tại nội dung 100m ếch.<br><p style=\"-webkit-font-smoothing: antialiased; text-rendering: geometricprecision; margin-top: 1em; margin-bottom: 1em; font-weight: 400;\">Ngày thi đấu thứ hai môn bơi SEA Games 32, kình ngư&nbsp;<a class=\"link-inline-content\" href=\"https://tuoitre.vn/pham-thanh-bao.html\" target=\"_blank\" title=\"Phạm Thanh Bảo\" data-rel=\"follow\" style=\"-webkit-font-smoothing: antialiased; text-rendering: geometricprecision; color: rgb(34, 106, 197); outline-style: initial; outline-width: 0px;\">Phạm Thanh Bảo</a>&nbsp;thi đấu chói sáng ở đường đua 100m bơi ếch.</p><p style=\"-webkit-font-smoothing: antialiased; text-rendering: geometricprecision; margin-top: 1em; margin-bottom: 1em; font-weight: 400;\">Vượt qua sự cạnh tranh gắt gao từ các đối thủ Singapore và Indonesia, Thanh Bảo về đích đầu tiên với thành tích 1 phút 00,97 giây. Thông số phá kỷ lục SEA Games cũng do chính Bảo thiết lập tại SEA Games 31 (1 phút 01,17 giây).</p><p style=\"-webkit-font-smoothing: antialiased; text-rendering: geometricprecision; margin-top: 1em; margin-bottom: 1em; font-weight: 400;\">Một điều thú vị là trước Thanh Bảo,&nbsp;<a class=\"link-inline-content\" href=\"https://tuoitre.vn/hy-vong-vang-tu-cac-nam-kinh-ngu-viet-nam-20230418090602076.htm\" target=\"_blank\" title=\"vận động viên giữ kỷ lục SEA Games\" data-rel=\"follow\" style=\"-webkit-font-smoothing: antialiased; text-rendering: geometricprecision; color: rgb(34, 106, 197); outline-style: initial; outline-width: 0px;\">kình ngư giữ kỷ lục SEA Games</a>&nbsp;nội dung 100m ếch chính là huyền thoại bơi lội Việt Nam Nguyễn Hữu Việt với thành tích 1 phút 01,60 giây lập năm 2009.</p><p style=\"-webkit-font-smoothing: antialiased; text-rendering: geometricprecision; margin-top: 1em; margin-bottom: 1em; font-weight: 400;\">Chia sẻ sau khi có lần thứ hai thiết lập kỷ lục SEA Games mới, Phạm Thanh Bảo nói: \"Tôi rất vui với thành tích này.&nbsp;</p><p style=\"-webkit-font-smoothing: antialiased; text-rendering: geometricprecision; margin-top: 1em; margin-bottom: 1em; font-weight: 400;\">Tôi muốn dành tặng huy chương vàng đến bà nội. Bà đã mất mà tôi không về được vì đang trong quá trình tập luyện chuẩn bị cho SEA Games 32. Tôi muốn nỗ lực hết sức, giành kết quả tốt nhất dành tặng bà.&nbsp;</p><p style=\"-webkit-font-smoothing: antialiased; text-rendering: geometricprecision; margin-top: 1em; margin-bottom: 1em; font-weight: 400;\">Trong những ngày tới, tôi vẫn sẽ tiếp tục thi đấu hết mình giành thành tích tốt\".</p><figure class=\"VCSortableInPreviewMode active\" type=\"Photo\" style=\"-webkit-font-smoothing: antialiased; text-rendering: geometricprecision; display: inline-block; flex-direction: column; margin-right: auto; margin-bottom: 15px; margin-left: auto; position: relative; transition: all 0.3s ease-in-out 0s; width: 730px; visibility: visible; overflow-wrap: break-word; cursor: default; max-width: 100%; font-weight: 400;\"><div id=\"adbro\" class=\"adbro-animated adbro-md\" style=\"-webkit-font-smoothing: antialiased; text-rendering: geometricprecision; outline-style: initial; outline-width: 0px; position: relative; overflow: hidden; width: 730px; height: 487px; top: 0px; margin-bottom: -487px; z-index: 1;\"><div class=\"adbro-dutchlady adbro-video-sound\" style=\"-webkit-font-smoothing: antialiased; text-rendering: geometricprecision; outline-style: initial; outline-width: 0px; position: absolute; top: 0px; bottom: 0px; left: 0px; width: 730px; overflow: hidden; margin: 0px !important;\"><div class=\"adbro-dutchlady__container\" style=\"-webkit-