ometricprecision; outline-style: initial; outline-width: 0px;\"><div id=\"placement-l3ybbvz3\" revenue=\"cpm\" style=\"-webkit-font-smoothing: antialiased; text-rendering: geometricprecision; outline-style: initial; outline-width: 0px;\"><div id=\"banner-joqxux31-l3ybbwme\" style=\"-webkit-font-smoothing: antialiased; text-rendering: geometricprecision; outline-style: initial; outline-width: 0px; min-height: 0px; min-width: 0px;\"><div id=\"slot-1-joqxux31-l3ybbwme\" style=\"-webkit-font-smoothing: antialiased; text-rendering: geometricprecision; outline-style: initial; outline-width: 0px;\"><div id=\"yomedia-passback-9bc24dc69f294f96b0f2b4c7a7278460-1702999730981\" style=\"-webkit-font-smoothing: antialiased; text-rendering: geometricprecision; outline-style: initial; outline-width: 0px;\"></div></div></div></div></div></div></div></div></div><figcaption class=\"PhotoCMS_Caption\" style=\"-webkit-font-smoothing: antialiased; text-rendering: geometricprecision; max-width: 100%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border-bottom: 1px solid rgb(242, 242, 242); padding: 8px 0px;\"><p data-placeholder=\"Nhập chú thích ảnh\" style=\"-webkit-font-smoothing: antialiased; text-rendering: geometricprecision; line-height: 22px; color: rgb(143, 143, 143); font-size: 16px !important;\">Niềm vui của Phạm Thanh Bảo trên bục nhận huy chương vàng nội dung 100m ếch môn bơi SEA</p></figcaption></figure></h2>', '2023-12-19 15:30:12', NULL, 1, 'Phá-kỷ-lục-SEA-Games,-Phạm-Thanh-Bảo-tặng-huy-chương-cho-người-bà-quá-cố', '50b08000b1f8a3e6e9751c93c70ba06d.jpg', 0),
(43, '250 vận động viên tranh tài Giải bơi, lặn các vận động viên xuất sắc quốc gia 2022', 17, 19, '<h2 class=\"detail-sapo\" data-role=\"sapo\" style=\"-webkit-font-smoothing: antialiased; text-rendering: geometricprecision; margin-top: 0px; margin-bottom: 24px; font-weight: 700; font-size: 17px; line-height: 30px; color: rgb(34, 34, 34); font-family: Roboto;\">TTO - Tham dự Giải bơi, lặn các vận động viên xuất sắc quốc gia có hơn 250 huấn luyện viên, vận động viên đến từ 21 tỉnh, thành, ngành trên cả nước. Các vận động viên tranh tài ở 36 nội dung bơi và 24 nội dung lặn.<br><p class=\"\" style=\"-webkit-font-smoothing: antialiased; text-rendering: geometricprecision; margin-top: 1em; margin-bottom: 1em; font-weight: 400;\">Ngày 24-10, tại Khu thể thao dưới nước tỉnh Tiền Giang, UBND tỉnh này đã phối hợp với Hiệp hội Thể thao dưới nước Việt Nam và Tổng cục Thể dục thể thao tổ chức Giải bơi, lặn các vận động viên xuất sắc quốc gia năm 2022.</p><p class=\"\" style=\"-webkit-font-smoothing: antialiased; text-rendering: geometricprecision; margin-top: 1em; margin-bottom: 1em; font-weight: 400;\">Tham dự giải có hơn 250 huấn luyện viên, vận động viên đến từ 21 tỉnh, thành, ngành trên cả nước. Các vận động viên tranh tài ở 36 nội dung bơi và 24 nội dung lặn.&nbsp;Giải đấu sẽ diễn ra từ ngày 24 đến 27-10.</p><div id=\"InreadPc\" style=\"-webkit-font-smoothing: antialiased; text-rendering: geometricprecision; font-weight: 400;\"><div id=\"zone-jnvk0c1v\" style=\"-webkit-font-smoothing: antialiased; text-rendering: geometricprecision;\"><div id=\"share-jnvk0cro\" style=\"-webkit-font-smoothing: antialiased; text-rendering: geometricprecision;\"><div id=\"placement-jojtzvtl\" revenue=\"cpm\" style=\"-webkit-font-smoothing: antialiased; text-rendering: geometricprecision;\"><div id=\"banner-jnvk0c1v-jojtzwgf\" style=\"-webkit-font-smoothing: antialiased; text-rendering: geometricprecision; min-height: 0px; min-width: 0px;\"><div id=\"slot-1-jnvk0c1v-jojtzwgf\" style=\"-webkit-font-smoothing: antialiased; text-rendering: geometricprecision;\"><div id=\"lv_isv_container\" style=\"-webkit-font-smoothing: antialiased; text-rendering: geometricprecision; width: 730px; height: 0px; transition: height 2s ease 0s; overflow: hidden;\"><iframe id=\"lv_isv_banner\" frameborder=\"0\" scrolling=\"no\" src=\"https://libs.akadigital.vn/videojs/inread/index.html#123,730,456,,https://delivery.akadigital.vn/www/delivery/fc.php?script=bannerTypeHtml:vastInlineBannerTypeHtml:vastInlineHtmlExtend&amp;format=vast&amp;nz=1&amp;zones=pre-roll%253D457&amp;version=2,true,true,https://tuoitre.vn/250-van-dong-vien-tranh-tai-giai-boi-lan-cac-van-dong-vien-xuat-sac-quoc-gia-2022-20221024121041499.htm\" style=\"-webkit-font-smoothing: antialiased; text-rendering: geometricprecision; width: 730px; height: 0px;\"></iframe></div></div></div></div></div></div></div><p class=\"\" style=\"-webkit-font-smoothing: antialiased; text-rendering: geometricprecision; margin-top: 1em; margin-bottom: 1em; font-weight: 400;\">Ông Nguyễn Đức Đảm - giám đốc Sở Văn hóa - Thể thao và Du lịch tỉnh Tiền Giang - cho biết việc tổ chức giải này nhằm kiểm tra, đánh giá việc tập luyện môn bơi, lặn của các đơn vị tỉnh, thành, ngành trong cả nước. Những vận động viên đạt thành tích lần này là cơ sở để tuyển chọn vận động viên cho đội tuyển và đội tuyển trẻ quốc gia.</p><p class=\"\" style=\"-webkit-font-smoothing: antialiased; text-rendering: geometricprecision; margin-top: 1em; margin-bottom: 1em; font-weight: 400;\">Giải đấu cũng nhằm cổ vũ, động viên để phát triển mạnh mẽ phong trào tập luyện môn bơi, lặn trong lực lượng thanh thiếu niên, sinh viên, học sinh, góp phần hiệu quả trong phòng, chống tai nạn đuối nước ở trẻ em, hưởng ứng tích cực cuộc vận động: \"Toàn dân rèn luyện thân thể theo gương Bác Hồ vĩ đại\".</p></h2>', '2023-12-19 15:31:40', NULL, 1, '250-vận-động-viên-tranh-tài-Giải-bơi,-lặn-các-vận-động-viên-xuất-sắc-quốc-gia-2022', '3f853485f4d47a1d0dbffa141c56fa72.jpg', 0);

